INSERT INTO `description` VALUES ('34', '<div class=\"textcontent\" id=\"desc\"> 							<a rel=\"nofollow\" href=\"http://app1.yts.re\" class=\"ajaxLink\"><img class=\"lazyjs bbcodeImage\" src=\"http://i5.minus.com/iUDOCknAFoU6E.png\" data-original=\"http://i5.minus.com/iUDOCknAFoU6E.png\" alt=\"image\" /></a><br /> <br /> <a rel=\"nofollow\" href=\"http://www.imdb.com/title/tt2562232/\">http://www.imdb.com/title/tt2562232/</a>IMDB RATING: 8.3<br /> FORMAT.......................: MP4<br /> <br /> CODEC........................: X264<br /> <br /> GENRE........................: Comedy / Drama<br /> <br /> FILE SIZE....................: 866.68 MB<br /> <br /> RESOLUTION...................: 1280*696<br /> <br /> FRAME RATE...................: 23.976 fps<br /> <br /> LANGUAGE.....................: English<br /> <br /> RUNTIME......................: 119 mins<br /> <br /> Riggan Thomas, once known quite well to movie theater goers as an iconic super hero called \"The Birdman\" had recently turned down a fourth installment of the franchise. Now washed up, he attempts to reinvent himself as a director by staging a new adaptation of a Raymond Carver short story called \"What We Talk About When We Talk About Love\". The events leading up to the Saturday night premiere prove to be one disaster after another as the original lead actor is injured while on set and Riggan scrambles to find a replacement, but the replacement proves to be exactly who he needs - a method actor who takes the job way too seriously. But Riggan has a hard time juggling between the set, his replacement actor, his equally washed up daughter, and a host of other disasters that prevent a proper staging of the play. Meanwhile, a New York Times critic who Riggan has to woo threatens to shut down production of the play before it even starts with a scathing review of the opening night performance. Does Riggan have a hit on his hands or will he even make it past opening night?<br /> <br /> SCREEN SHOTS:<br /> <a re