INSERT INTO `description` VALUES ('41', '<div class=\"textcontent\" id=\"desc\"> 							-------------------------------------------------------------------------------<br /> <br /> -------------------------------------------------------------------------------Get all YIFYs newest releases first at <br /> <br /> Also there you will find a list of upcoming uploads, instant chat, account registration and an effective movie search. <br /> <a rel=\"nofollow\" href=\"http://www.imdb.com/title/tt1790864/IMDB\">http://www.imdb.com/title/tt1790864/IMDB</a> RATING: 7.2<br /> <br /> FORMAT.......................: MP4<br /> CODEC........................: X264<br /> GENRE........................: Action<br /> FILE SIZE....................: 1.65 GB<br /> RESOLUTION...................: 1920*800<br /> FRAME RATE...................: 23.976 fps<br /> LANGUAGE.....................: English<br /> SUBTITLES....................: NONE<br /> RUNTIME......................: 113 mins<br /> Thomas wakes up in an elevator, remembering nothing but his own name. He emerges into a world of about 60 teen boys who have learned to survive in a completely enclosed environment, subsisting on their own agriculture and supplies. A new boy arrives every 30 days. The original group has been in \"The Glade\" for two years, trying to find a way to escape through the Maze that surrounds their living space. They have begun to give up hope. Then a comatose girl arrives with a strange note, and their world begins to change. There are some great, fast-paced action scenes, particularly those involving the nightmarish Grievers who plague the boys 						</div>');
INSERT INTO `description` VALUES ('42', '<div class=\"textcontent\" id=\"desc\"> 							<a rel=\"nofollow\" href=\"http://yts.re\" class=\"ajaxLink\"><img class=\"lazyjs bbcodeImage\" src=\"http://i5.minus.com/iUDOCknAFoU6E.png\" data-original=\"http://i5.minus.com/iUDOCknAFoU6E.png\" alt=\"image\" /></a><a rel=\"nofollow\" href=\"http://www.imdb.com/title/tt2872718/\">http://www.imdb.com/title/tt2872718/</a><a rel=\"nofollow\" href=\"http://istoreimg.com/i/54cac5366dd9a.html\" class=\"ajaxLink\"><img class=\"lazyjs bbcodeImage\" src=\"http://istoreimg.com/upload/small/2015/01/30/54cac5366dd5e.jpg\" data-original=\"http://istoreimg.com/upload/small/2015/01/30/54cac5366dd5e.jpg\" alt=\"image\" /></a>IMDB RATING: 8.1FORMAT..............: MP4<br /> CODEC...............: X264<br /> GENRE...............: Crime<br /> FILE SIZE...........: 864.89 MB<br /> RESOLUTION..........: 1280*536<br /> FRAME RATE..........: 23.976 fps<br /> AUDIO...............: 92.0 Kbps AAC-LC (2CH)<br /> SUBTITLES...........: NONE<br /> LANGUAGE............: English<br /> RUNTIME.............: 118 minsNIGHTCRAWLER is a thriller set in the nocturnal underbelly of contemporary Los Angeles. Jake Gyllenhaal stars as Lou Bloom, a driven young man desperate for work who discovers the high-speed world of L.A. crime journalism. Finding a group of freelance camera crews who film crashes, fires, murder and other mayhem, Lou muscles into the cut-throat, dangerous realm of nightcrawling - where each police siren wail equals a possible windfall and victims are converted into dollars and cents. Aided by Rene Russo as Nina, a veteran of the blood-sport that is local TV news, Lou blurs the line between observer and participant to become the star of his own story.<br /> <br /> <a rel=\"nofollow\" href=\"http://istoreimg.com/i/54cac535b19df.html\" class=\"ajaxLink\"><img class=\"lazyjs bbcodeImage\" src=\"http://istoreimg.com/upload/small/2015/01/30/54cac535b19a3.png\" data-original=\"http://istoreimg.com/upload/sm