INSERT INTO `description` VALUES ('50', '<div class=\"textcontent\" id=\"desc\"> 							<img class=\"lazyjs bbcodeImage\" src=\"http://extraimago.com/images/2015/02/26/trovI3R.jpg\" data-original=\"http://extraimago.com/images/2015/02/26/trovI3R.jpg\" alt=\"image\" /><br />  <br />  <a rel=\"nofollow\" href=\"http://www.imdb.com/title/tt2802144/\">http://www.imdb.com/title/tt2802144/</a><br />  <br />  A spy organization recruits an unrefined, but promising street kid into the agency\'s ultra-competitive training program just as a global threat emerges from a twisted tech genius.<br />  <br />  Director: Matthew Vaughn<br />  Writers: Jane Goldman (screenplay), Matthew Vaughn (screenplay)<br />  Stars: Colin Firth, Taron Egerton, Samuel L. Jackson<br />  Genres: Action | Adventure | Comedy | Crime<br />  Country: UK<br />  Language: English | Arabic | Swedish<br />  <br />  <br />  Thx Hive<br />  <br />  CM8 Doing It Right The First Time<br />  <br />  <br />  Sources:<br />  Video:New 720P HDCAM (spanish i think)<br />  Audio: New HQMic Audio<br />  thx<br />  <br />  Notes:<br />  got this very hiqh quality hdcam from a spanish cammer, the guy did a perfect job, such hiqh quality is rare.<br />  Also got a new direct hqmic, all voices are clear, music and effects are intact, i have heard worse \"line\" tagged audios.<br />  Usually i dont do cams, since i want to get out quality only, but i couldnt refuse on this case, the movie is worth it<br />  worked a whole week on that on every spare time i had, so its gonna be good.<br />  <br />  VideoEncode:<br />  the video was great to begin with, it was bright enough, the colours are perfect, no kind of pixelation, even fast action scenes were flawless.<br />  quality wise hard to beat, didnt have to change anything for the video itself<br />  the cam i got was already clipped together from 2 recordings the same guy made, looks like he got disturbed on first try after 1h and went again and did the 2nd hour<br />  so first 1h he basically cammed straight ahead sitting in the center, but he aimed 15mins too high and than 15mins a bit too low and so on.<br />  the 2nd hour he tried camming from a corner, so video was still perfect but skewed angle and zoomed out, he still did a perfect job that can be fixed easily.<br />  <br />  so basically i had to cut the movie in around 30 pieces and adjusted each spot as needed, i invested too much time but the result is perfect.<br />  <br />  to already answer the first comment that will pop up for sure, is there anything missing from the video?<br />  yes i had to cut out 30secs at runtime 15mins and another 20secs at 20min, and at the church scene another 30secs<br />  so 80seconds are missing due security cause he aimed to the ceiling or floor, does it matter no, its no biggy at all<br />  <br />  AudioEncode:<br />  for the audio i was quite surprised, it was very good, bet someone might tag it as line but it isnt.<br />  as mentioned above you can hear clearly what is said all the time, music and effects are all good, 2 times you can hear a phone ring, lol<br />  <br />  the audio i got was full and direct, so i started syncing it to my video, was done in 5h, whole movie is lipsync now, love to do that.<br />  <br />  all in all its quite perfect for a cam i would say 8/10 for video and audio, check sample if you like<br />  <br />  got very nice<br />  enjoy<br />  <br />  <br />  Video: 720x304 @bitrate 1800 2pass<br />  Audio: English AC3 2.0 Stereo<br />  Subs: English subs for foreign parts only were already hardcoded<br />  <br />  <br />  PS:<br />  since i have done all @720p a higher encode is possible if ya want<br />  <br />  <br />  <a rel=\"nofollow\" href=\"http://www.imdb.com/title/tt2802144/\">http://www.imdb.com/title/tt2802144/</a><br />  <br />  <br />  <br />  General<br />  Complete name : Kingsman-The.Secret.Service.2014.HDCAM.XVID.AC3.HQ.Hive-CM8.avi<br />  Format : AVI<br />  Format/Info : Audio Video Interleave