INSERT INTO `description` VALUES ('51', '<div class=\"textcontent\" id=\"desc\"> 							<a rel=\"nofollow\" href=\"http://yts.re\" class=\"ajaxLink\"><img class=\"lazyjs bbcodeImage\" src=\"http://i5.minus.com/iUDOCknAFoU6E.png\" data-original=\"http://i5.minus.com/iUDOCknAFoU6E.png\" alt=\"image\" /></a><br /> <br />  <br />  <a rel=\"nofollow\" href=\"http://www.imdb.com/title/tt2692250/\">http://www.imdb.com/title/tt2692250/</a><br />  <br />  <br />  IMDB RATING: 6.5<br />  <br />  FORMAT.......................: MP4<br />  CODEC........................: X264<br />  GENRE........................: Adventure / Comedy<br />  FILE SIZE....................: 1.45 GB<br />  RESOLUTION...................: 1920*1040<br />  FRAME RATE...................: 23.976 fps<br />  LANGUAGE.....................: English<br />  RUNTIME......................: 98 mins<br />  <br />  <br />  <br />  At the Museum of Natural History, there\'s new exhibit being unveiled. Larry Daley who manages the night exhibit because the exhibits come to life because of the Tablet of Ahkmenrah, is in charge of the presentation. But when the exhibits go wild, Larry finds himself in trouble. He learns that the Tablet is corroding so he does some research and learns that Cecil, the former museum guard was at the site when the Tablet was discovered. He tells Larry that they were warned that if they remove it could mean the end. Larry realizes it means the end of magic. He talks to Ahkmenrah who says that he doesn\'t know anything. Only his father the Pharoah knows the Tablet\'s secrets. He learns that the Pharoah was sent to the London museum. So he convinces, Dr. McPhee the museum curator to help send him to London. He goes and takes Ahkmenrah with him but some of the others like Teddy Roosevelt, Attila, Octavius, and Jedediah come with him. <br />  <br />  SCREEN SHOTS:<br />  <br />  <a rel=\"nofollow\" href=\"http://istoreimg.com/i/54eed8e6cbadc.html\" class=\"ajaxLink\"><img class=\"lazyjs bbcodeImage