INSERT INTO `description` VALUES ('62', '<div class=\"textcontent\" id=\"desc\"> 							<div class=\"center\"><br />  <b><span style=\"font-size:%\"><span style=\"color:#ff0000\"># Le Hobbit la Bataille des Cinq Armées #</span></span></b> <br />  <br />  <img class=\"lazyjs bbcodeImage\" src=\"http://upload.titaxium.com/images/lehobbitla.jpg\" data-original=\"http://upload.titaxium.com/images/lehobbitla.jpg\" alt=\"image\" /> <br />  <br />  <b><span style=\"color:#0000FF\">Date de sortie : 10 décembre 2014<br />  <br />  Réalisateur : Peter Jackson<br />  <br />  Acteurs : Martin Freeman, Richard Armitage, Evangeline Lilly<br />  <br />  Film : Américain , néo-zélandais<br />  <br />  Genre : Action , Fantastique , Aventure<br />  <br />  Durée : 2h24min<br />  <br />  Titre original : The Hobbit: The Battle of the Five Armies</span></b> <br />  <br />  <b><span style=\"color:#000000\">Atteignant enfin la Montagne Solitaire, Thorin et les Nains, aidés par Bilbon le Hobbit, ont réussi à récupérer leur royaume et leur trésor. Mais ils ont également réveillé le dragon Smaug qui déchaîne désormais sa colère sur les habitants de Lac-ville. A présent, les Nains, les Elfes, les Humains mais aussi les Wrags et les Orques menés par le Nécromancien, convoitent les richesses de la Montagne Solitaire. La bataille des cinq armées est imminente et Bilbon est le seul à pouvoir unir ses amis contre les puissances obscures de Sauron.</span></b><br />  <br />  <b>Format : AVI<br />  Format/Info : Audio Video Interleave<br />  Profil du format : OpenDML<br />  Taille du fichier : 1,38 Gio<br />  Durée : 2h 24mn<br />  Débit global moyen : 1 370 Kbps<br />  Application utilisée : Lavf55.37.100<br />  Largeur : 720 pixels<br />  Hauteur : 300 pixels<br />  </b><br />   <br />  <span style=\"font-size:100%\"><b>Thumbs</b></span><br />  <br />  <a rel=\"nofollow\" href=\"http://gallerynova.se/site/v/261156\" class=\"ajaxLink\">http://gallerynova.se/site/v/261156</a></div> 						</div>');
