INSERT INTO `description` VALUES ('68', '<div class=\"textcontent\" id=\"desc\"> 							<a rel=\"nofollow\" href=\"http://yts.re\" class=\"ajaxLink\"><img class=\"lazyjs bbcodeImage\" src=\"http://i5.minus.com/iUDOCknAFoU6E.png\" data-original=\"http://i5.minus.com/iUDOCknAFoU6E.png\" alt=\"image\" /></a><a rel=\"nofollow\" href=\"http://www.imdb.com/title/tt2294629/\">http://www.imdb.com/title/tt2294629/</a><a rel=\"nofollow\" href=\"http://istoreimg.com/i/530edbf17adef.html\" class=\"ajaxLink\"><img class=\"lazyjs bbcodeImage\" src=\"http://istoreimg.com/upload/small/2014/02/27/530edbf17adb4.jpg\" data-original=\"http://istoreimg.com/upload/small/2014/02/27/530edbf17adb4.jpg\" alt=\"image\" /></a>IMDB RATING: 8.0FORMAT..............: MP4<br /> CODEC...............: X264<br /> GENRE...............: Animation<br /> FILE SIZE...........: 1.63 GB<br /> RESOLUTION..........: 1920*816<br /> FRAME RATE..........: 23.976 fps<br /> AUDIO...............: 92.0 Kbps AAC-LC (2CH)<br /> SUBTITLES...........: NONE<br /> LANGUAGE............: English<br /> RUNTIME.............: 102 minsAnna, a fearless optimist, sets off on an epic journey - teaming up with rugged mountain man Kristoff and his loyal reindeer Sven - to find her sister Elsa, whose icy powers have trapped the kingdom of Arendelle in eternal winter. Encountering Everest-like conditions, mystical trolls and a hilarious snowman named Olaf, Anna and Kristoff battle the elements in a race to save the kingdom. From the outside Anna\'s sister, Elsa looks poised, regal and reserved, but in reality, she lives in fear as she wrestles with a mighty secret-she was born with the power to create ice and snow. It\'s a beautiful ability, but also extremely dangerous. Haunted by the moment her magic nearly killed her younger sister Anna, Elsa has isolated herself, spending every waking minute trying to suppress her growing powers. Her mounting emotions trigger the magic, accidentally setting off an eternal winter that she can\'t sto