INSERT INTO `description` VALUES ('79', '<div class=\"textcontent\" id=\"desc\"> 							<div class=\"center\"><b><span style=\"font-size:%\"><span style=\"color:#ff0000\"><br />  # Exodus : Gods And Kings #</span></span></b> <br />  <br />  <img class=\"lazyjs bbcodeImage\" src=\"http://upload.titaxium.com/images/exodusgods.jpg\" data-original=\"http://upload.titaxium.com/images/exodusgods.jpg\" alt=\"image\" /> <br />  <br />  <b><span style=\"color:#0000FF\">Date de sortie : 24 décembre 2014<br />   <br />  Réalisateur : Ridley Scott<br />  <br />  Acteurs : Christian Bale, Joel Edgerton, John Turturro<br />  <br />  Film : Américain, Britannique, Espagnol<br />  <br />  Genre : Péplum, Action<br />  <br />  Durée : 2h31min <br />  </span></b> <br />  <br />  <b><span style=\"color:#000000\">L’histoire d’un homme qui osa braver la puissance de tout un empire.Ridley Scott nous offre une nouvelle vision de l’histoire de Moïse, leader insoumis qui défia le pharaon Ramsès, entraînant 600 000 esclaves dans un périple grandiose pour fuir l’Egypte et échapper au terrible cycle des dix plaies.<br />  </span></b><br />  <br />  <b>Format : AVI<br />  Format/Info : Audio Video Interleave<br />  Taille du fichier : 1,37 Gio<br />  Durée : 2h 30mn<br />  Débit global moyen : 1 300 Kbps<br />  Application utilisée : VirtualDubMod 1.5.10.2 Fr | www.trad-fr.com || (build 2540/release)<br />  Bibliothèque utilisée : VirtualDubMod build 2540/release<br />  Largeur : 640 pixels<br />  Hauteur : 272 pixels<br />  </b></div> 						</div>');
INSERT INTO `description` VALUES ('80', '<div class=\"textcontent\" id=\"desc\"> 							<a rel=\"nofollow\" href=\"http://yts.re\" class=\"ajaxLink\"><img class=\"lazyjs bbcodeImage\" src=\"http://i5.minus.com/iUDOCknAFoU6E.png\" data-original=\"http://i5.minus.com/iUDOCknAFoU6E.png\" alt=\"image\" /></a><a rel=\"nofollow\" href=\"http://www.imdb.com/title/tt1631867/\">http://www.imdb.com/title/tt1631867/</a><a rel=\"nofollow\" href=\"http://istoreimg.com/i/541978a579b76.html\" class=\"ajaxLink\"><img class=\"lazyjs bbcodeImage\" src=\"http://istoreimg.com/upload/small/2014/09/18/541978a579b3a.jpg\" data-original=\"http://istoreimg.com/upload/small/2014/09/18/541978a579b3a.jpg\" alt=\"image\" /></a>IMDB RATING: 8.1FORMAT..............: MP4<br /> CODEC...............: X264<br /> GENRE...............: Action<br /> FILE SIZE...........: 1.65 GB<br /> RESOLUTION..........: 1920*800<br /> FRAME RATE..........: 23.976 fps<br /> AUDIO...............: 92.0 Kbps AAC-LC (2CH)<br /> SUBTITLES...........: NONE<br /> LANGUAGE............: English<br /> RUNTIME.............: 113 minsAn alien race has hit the Earth in an unrelenting assault, unbeatable by any military unit in the world. Major William Cage (Cruise) is an officer who has never seen a day of combat when he is unceremoniously dropped into what amounts to a suicide mission. Killed within minutes, Cage now finds himself inexplicably thrown into a time loop-forcing him to live out the same brutal combat over and over, fighting and dying again...and again. But with each battle, Cage becomes able to engage the adversaries with increasing skill, alongside Special Forces warrior Rita Vrataski (Blunt). And, as Cage and Vrataski take the fight to the aliens, each repeated encounter gets them one step closer to defeating the enemy.<br /> <br /> <a rel=\"nofollow\" href=\"http://istoreimg.com/i/541978a4e1960.html\" class=\"ajaxLink\"><img class=\"lazyjs bbcodeImage\" src=\"http://istoreimg.com/upload/small/2014/09/18/541978a4e19