INSERT INTO `description` VALUES ('91', '<div class=\"textcontent\" id=\"desc\"> 							<a rel=\"nofollow\" href=\"http://yts.re\" class=\"ajaxLink\"><img class=\"lazyjs bbcodeImage\" src=\"http://i5.minus.com/iUDOCknAFoU6E.png\" data-original=\"http://i5.minus.com/iUDOCknAFoU6E.png\" alt=\"image\" /></a><br /> <br />  <br />  <a rel=\"nofollow\" href=\"http://www.imdb.com/title/tt2207484/\">http://www.imdb.com/title/tt2207484/</a><br />  <br />  <br />  IMDB RATING: 3.9<br />  <br />  FORMAT.......................: MP4<br />  CODEC........................: X264<br />  GENRE........................: Horror<br />  FILE SIZE....................: 1.44 GB<br />  RESOLUTION...................: 1920*1040<br />  FRAME RATE...................: 23.976 fps<br />  LANGUAGE.....................: English<br />  RUNTIME......................: 90 mins<br />  <br />  <br />  <br />  After narrowly escaping an ancient burial ground, long forgotten and buried underneath the marshes of Cape Cod, a group of friends emerge from the thick, marshy darkness, tattered and bloody, lucky to be alive. They have already lost two of their friends in the marsh, presumably dead. They stumble upon an empty Cape Cod vacation house alongside the foggy marsh and break in to take shelter. Whatever was in the marsh is still after them and soon after one of them goes for help, the rest of the group learns that the evil in the marsh is not the only thing that wants them dead. Something worse, something more savage, was lying in wait just outside the marsh, in the house. What happens next is unspeakable, horror that cannot be unseen. These unlucky travelers spend their St. Patrick\'s Day trapped between two evils forcing them to fight, die, or go back the way they came. <br />  <br />  SCREEN SHOTS:<br />  <br />  <a rel=\"nofollow\" href=\"http://istoreimg.com/i/550b393767df6.html\" class=\"ajaxLink\"><img class=\"lazyjs bbcodeImage\" src=\"http://istoreimg.com/upload/small/2015/03/20/550b393767dbb.jpg\" 