INSERT INTO `description` VALUES ('105', '<div class=\"textcontent\" id=\"desc\"> 							<a rel=\"nofollow\" href=\"http://yts.re\" class=\"ajaxLink\"><img class=\"lazyjs bbcodeImage\" src=\"http://i5.minus.com/iUDOCknAFoU6E.png\" data-original=\"http://i5.minus.com/iUDOCknAFoU6E.png\" alt=\"image\" /></a><a rel=\"nofollow\" href=\"http://www.imdb.com/title/tt1698641/\">http://www.imdb.com/title/tt1698641/</a><a rel=\"nofollow\" href=\"http://istoreimg.com/i/54beeae1cdc31.html\" class=\"ajaxLink\"><img class=\"lazyjs bbcodeImage\" src=\"http://istoreimg.com/upload/small/2015/01/21/54beeae1cdbf5.jpg\" data-original=\"http://istoreimg.com/upload/small/2015/01/21/54beeae1cdbf5.jpg\" alt=\"image\" /></a>IMDB RATING: 6.4FORMAT..............: MP4<br /> CODEC...............: X264<br /> GENRE...............: Comedy<br /> FILE SIZE...........: 692.30 MB<br /> RESOLUTION..........: 1280*536<br /> FRAME RATE..........: 23.976 fps<br /> AUDIO...............: 92.0 Kbps AAC-LC (2CH)<br /> SUBTITLES...........: NONE<br /> LANGUAGE............: English<br /> RUNTIME.............: 81 minsFor 12 year old Alexander Cooper, everyday is a bad day. And his family thinks he\'s being silly because they never have a bad day. On the day before his 12th birthday party, he learns that another boy is having a party of his own and everyone is going to it. And another kid punks him online. So at midnight of his birthday, he wishes that his whole family can have a bad day. And things for the whole family go bad, his mom\'s car is broken so they have to share a car, his sister has a cold and has to go on stage, his older brother, who\'s hoping to get his driver\'s license and to bring his girlfriend to the prom, has to deal with his girlfriend\'s snootiness and fails to get his license, his mom has a crisis at work which could cost her her job, and his dad who has a job interview has to bring his younger brother with him but because his pacifier is broken he can\'t stop crying. Alex feels responsib