INSERT INTO `description` VALUES ('113', '<div class=\"textcontent\" id=\"desc\"> 							<div class=\"center\"><b><span style=\"color:#ff0000\"># John Wick #</span></b><br />  <br />  <a rel=\"nofollow\" href=\"http://gallerynova.se/site/v/262498\" class=\"ajaxLink\">http://gallerynova.se/site/v/262498</a><br />  <br />  <img class=\"lazyjs bbcodeImage\" src=\"http://upload.titaxium.com/images/255061.jpg\" data-original=\"http://upload.titaxium.com/images/255061.jpg\" alt=\"image\" /> <br />  <br />  <b><span style=\"color:#0000FF\">Date de sortie : 29 octobre 2014<br />  <br />  Réalisateur : David Leitch<br />  <br />  Acteurs : Keanu Reeves, Michael Nyqvist, Alfie Allen<br />  <br />  Film Américain<br />  <br />  Genre : Action, Thriller<br />  <br />  Durée : 1h41min <br />  </span></b><br />  <br />  <b><span style=\"color:#000000\">Depuis la mort de sa femme bien-aimée, John Wick passe ses journées à retaper sa Ford Mustang de 1969, avec pour seule compagnie sa chienne Daisy. Il mène une vie sans histoire, jusqu’à ce qu’un malfrat sadique nommé Iosef Tarasof remarque sa voiture. John refuse de la lui vendre. Iosef n’acceptant pas qu’on lui résiste, s’introduit chez John avec deux complices pour voler la Mustang, et tuer sauvagement Daisy…John remonte la piste de Iosef jusqu’à New York. Un ancien contact, Aurelio, lui apprend que le malfrat est le fils unique d’un grand patron de la pègre, Viggo Tarasof. La rumeur se répand rapidement dans le milieu : le légendaire tueur cherche Iosef. Viggo met à prix la tête de John : quiconque l’abattra touchera une énorme récompense. John a désormais tous les assassins de New York aux trousses.<br />  </span></b></div> 						</div>');
