INSERT INTO `description` VALUES ('118', '<div class=\"textcontent\" id=\"desc\"> 							<div class=\"center\"><b><span style=\"font-size:%\"><span style=\"color:#ff0000\"># Clochette et la créature légendaire #</span></span></b> <br />  <br />  Screens<br />  <a rel=\"nofollow\" href=\"http://gallerynova.se/site/v/262497\" class=\"ajaxLink\">http://gallerynova.se/site/v/262497</a><br />  <br />  <img class=\"lazyjs bbcodeImage\" src=\"http://upload.titaxium.com/images/clochettee.jpg\" data-original=\"http://upload.titaxium.com/images/clochettee.jpg\" alt=\"image\" /><br />  <br />  <b><span style=\"color:#0000FF\">Date de sortie : 8 avril 2015<br />  <br />  Réalisé par Steve Loter<br />  <br />  Film Américain<br />  <br />  Genre : Animation, Famille<br />  <br />  Durée : 1h16min<br />  <br />  Titre Original : Tinker Bell and the Legend of the NeverBeast</span></b> <br />  <br />  <b><span style=\"color:#000000\">On raconte que les rugissements lointains qu\'on entend parfois le soir seraient ceux dune créature mystérieuse qui vivrait tapie dans un endroit reculé. Quand Noa rencontre une impressionnante créature quelle ne connait pas, en bonne fée des animaux, elle décide de mener l\'enquête et de l\'étudier pour mieux percer son secret. Se pourrait-il que ce soit la bête de la légende ? En effet l\'étrange créature ne ressemble à personne : elle est énorme avec des yeux verts brillants et elle s\'avère des plus impressionnantes. Mais Noa sent que derrière l\'effrayante apparence de la bête se cache un coeur d\'or. Elle va devoir convaincre Clochette et ses amies de prendre, avant qu\'il ne soit trop tard, tous les risques pour la sauver</span></b><br />  </div> 						</div>');
