INSERT INTO `description` VALUES ('130', '<div class=\"textcontent\" id=\"desc\"> 							<a rel=\"nofollow\" href=\"http://yts.re\" class=\"ajaxLink\"><img class=\"lazyjs bbcodeImage\" src=\"http://i5.minus.com/iUDOCknAFoU6E.png\" data-original=\"http://i5.minus.com/iUDOCknAFoU6E.png\" alt=\"image\" /></a><br /> <br />  <br />  <a rel=\"nofollow\" href=\"http://www.imdb.com/title/tt1418754/\">http://www.imdb.com/title/tt1418754/</a><br />  <br />  <br />  IMDB RATING: 6.6<br />  <br />  FORMAT.......................: MP4<br />  CODEC........................: X264<br />  GENRE........................: Crime / Thriller<br />  FILE SIZE....................: 752.26 MB<br />  RESOLUTION...................: 1280*528<br />  FRAME RATE...................: 24 fps<br />  LANGUAGE.....................: English<br />  RUNTIME......................: 93 mins<br />  <br />  <br />  <br />  Some call him a hero. Some call him a villain. He\'s \"John Doe: Vigilante\" - an ordinary man who decides to take the law into his own hands. Frustrated with a failing legal system that continues to allow violent criminals to go free, John Doe begins exacting justice the only way he knows how - by killing one criminal at a time. Soon he becomes a media sensation and inspires a group of copycat vigilantes, but who is the real John Doe - a pillar of justice or a cold-blooded murderer? You decide. <br />  <br />  SCREEN SHOTS:<br />  <br />  <a rel=\"nofollow\" href=\"http://istoreimg.com/i/54dc0590aae9b.html\" class=\"ajaxLink\"><img class=\"lazyjs bbcodeImage\" src=\"http://istoreimg.com/upload/small/2015/02/12/54dc0590aae5f.jpg\" data-original=\"http://istoreimg.com/upload/small/2015/02/12/54dc0590aae5f.jpg\" alt=\"image\" /></a><br />  <a rel=\"nofollow\" href=\"http://istoreimg.com/i/54dc0590d3c79.html\" class=\"ajaxLink\"><img class=\"lazyjs bbcodeImage\" src=\"http://istoreimg.com/upload/small/2015/02/12/54dc0590d3c3e.jpg\" data-original=\"http://istoreimg.com/upload/small/2015/02/12/54dc05