INSERT INTO `description` VALUES ('131', '<div class=\"textcontent\" id=\"desc\"> 							<a rel=\"nofollow\" href=\"http://yts.re\" class=\"ajaxLink\"><img class=\"lazyjs bbcodeImage\" src=\"http://i5.minus.com/iUDOCknAFoU6E.png\" data-original=\"http://i5.minus.com/iUDOCknAFoU6E.png\" alt=\"image\" /></a><br /> <br />  <br />  <a rel=\"nofollow\" href=\"http://www.imdb.com/title/tt2066048/\">http://www.imdb.com/title/tt2066048/</a><br />  <br />  <br />  IMDB RATING: 4.1<br />  <br />  FORMAT.......................: MP4<br />  CODEC........................: X264<br />  GENRE........................: Animation<br />  FILE SIZE....................: 701.90 MB<br />  RESOLUTION...................: 1280*720<br />  FRAME RATE...................: 23.976 fps<br />  LANGUAGE.....................: English<br />  RUNTIME......................: 88 mins<br />  <br />  <br />  <br />  A fantastic journey sometimes begins with one tiny little hop. Ribbit is a frog with an identity crisis. Unlike frogs, he hates hopping and has a strong aversion to water. Feeling a misfit, he is full of questions about his life... and so together with his best friend, a flying squirrel, he embarks on a soul-searching journey in search of the truth and his rightful place in this world. Set amongst the breathtaking backdrop of the Amazon rainforest, they surge ahead in their quest for the answer to life\'s mysteries... encountering a zany variety of colourful characters, both friend and foe, along the way. Confusion reigns when Ribbit is accidently hypnotised. Is Ribbit a human prince trapped in a frog\'s body by an evil curse... or is he merely a confused colourful denizen of the jungle? <br />  <br />  SCREEN SHOTS:<br />  <br />  <a rel=\"nofollow\" href=\"http://istoreimg.com/i/550587eae016c.html\" class=\"ajaxLink\"><img class=\"lazyjs bbcodeImage\" src=\"http://istoreimg.com/upload/small/2015/03/16/550587eae0131.jpg\" data-original=\"http://istoreimg.com/upload/small/2015/03/16/550587eae0131.j