INSERT INTO `description` VALUES ('133', '<div class=\"textcontent\" id=\"desc\"> 							<a rel=\"nofollow\" href=\"http://yts.re\" class=\"ajaxLink\"><img class=\"lazyjs bbcodeImage\" src=\"http://i5.minus.com/iUDOCknAFoU6E.png\" data-original=\"http://i5.minus.com/iUDOCknAFoU6E.png\" alt=\"image\" /></a><br /> <br />  <br />  <a rel=\"nofollow\" href=\"http://www.imdb.com/title/tt0120623/\">http://www.imdb.com/title/tt0120623/</a><br />  <br />  <br />  IMDB RATING: 7.2<br />  <br />  FORMAT.......................: MP4<br />  CODEC........................: X264<br />  GENRE........................: Animation / Adventure<br />  FILE SIZE....................: 1.44 GB<br />  RESOLUTION...................: 1920*816<br />  FRAME RATE...................: 23.976 fps<br />  LANGUAGE.....................: English<br />  RUNTIME......................: 95 mins<br />  <br />  <br />  <br />  Every year, a bunch of grasshoppers come to the anthill and eat what the ants have gathered for them. The \"offering\", as the ants call the ritual, is a part of their fate. One day in spring, when the offering\'s preparation has just been finished, Flik, unliked inventor ant, accidentally drops the whole offered seeds into the river. The grasshoppers come and give the ants a second chance to collect food until fall. Flik sets off to find bugs that are willing to fight the grasshoppers (nobody expects him to succeed anyway) and, due to a double misinterpretation, returns with a circus crew, giving everybody new hope. When the misunderstanding finally gets cleared out, there is only little time left for a new plan, which has to work, or else... <br />  <br />  SCREEN SHOTS:<br />  <br />  <a rel=\"nofollow\" href=\"http://istoreimg.com/i/550244ba160af.html\" class=\"ajaxLink\"><img class=\"lazyjs bbcodeImage\" src=\"http://istoreimg.com/upload/small/2015/03/13/550244ba16073.jpg\" data-original=\"http://istoreimg.com/upload/small/2015/03/13/550244ba16073.jpg\" alt=\"image\" /></a><br />  <a