INSERT INTO `description` VALUES ('136', '<div class=\"textcontent\" id=\"desc\"> 							<div class=\"center\"><img class=\"lazyjs bbcodeImage\" src=\"http://i.imgur.com/TiTEoEr.jpg\" data-original=\"http://i.imgur.com/TiTEoEr.jpg\" alt=\"image\" /><br />  <br />  <b><span style=\"font-size:200%\"><span style=\"color:Darkslateblue\">Now You See Me</span></span></b><br />  <br />  <img class=\"lazyjs bbcodeImage\" src=\"http://i.imgur.com/Q2FJ8us.jpg\" data-original=\"http://i.imgur.com/Q2FJ8us.jpg\" alt=\"image\" /><br />  <br />  <b><span style=\"color:Darkolivegreen\">.: Scheda del Film :.</span></b><br />  <br />  <b><span style=\"color:Darkmagenta\">Titolo originale: 	Now You See Me<br />  Nazione: 	Francia, U.S.A.<br />  Anno: 	2013<br />  Genere: 	Thriller<br />  Durata: 	116\'<br />  Regia: 	Louis Leterrier<br />  Data di uscita: 11 Luglio 2013<br />  </span></b><br />  <br />  <b><span style=\"color:Darkolivegreen\">.: CasT :.</span></b><br />  <br />  <b><span style=\"color:Darkmagenta\">Jesse Eisenberg<br />  Mark Ruffalo<br />  Woody Harrelson<br />  Isla Fisher<br />  Dave Franco<br />  Mélanie Laurent<br />  Morgan Freeman<br />  Michael Caine<br />  Common<br />  Caitriona Balfe</span></b><br />  <br />  <b><span style=\"color:Darkolivegreen\">.: Trama :.</span></b><br />  <br />  <b><span style=\"color:Darkmagenta\">I Quattro Cavalieri, un super-gruppo di maghi guidato dal carismatico Atlas (Jesse Eisenberg), si esibiscono in un paio di spettacoli di magia di alta tecnologia e alto profilo, prima strabiliando il pubblico rapinando una banca di Parigi da Las Vegas, e poi smascherando un colletto bianco criminale e convogliando i suoi milioni sui conti bancari dei membri del pubblico, confondendo le autorità con i loro colpi grossi pianificati in modo intricato. L’agente speciale dell’FBI Dylan Hobbs (Mark Ru!alo) è determinato a far pagare i maghi per i loro crimini – e a fermarli prima che portino a termine quella che promette di essere una rapina ancora più ardita. Purtroppo è costretto a lavorare insieme a Alma (Mélanie Laurent), una detective dell’Interpol che a lui sembra subito sospetta. Disperato si rivolge a Thaddeus (Morgan Freeman), un famoso smascheratore di magie, che sostiene che il trucco della banca di Parigi in realtà era un trucco meticolosamente progettato. Dylan e Alma iniziano a chiedersi se i Quattro Cavalieri abbiano una persona di riferimento esterna. Se così fosse, trovarla sarebbe la chiave per porre termine alla frenetica attività criminale dei maghi. Ma chi potrebbe essere quest’uomo o questa donna? O potrebbe davvero trattarsi di … magia? Mentre la pressione sale e il mondo aspetta lo spettacolare trucco finale dei Cavalieri, Dylan e Alma corrono per stare un passo avanti ai maghi. Presto però diventerà chiaro che superare in astuzia questi maestri dell’illusione è oltre ogni capacità umana.<br />  <br />  </span></b><br />  <br />  <b><span style=\"color:Darkolivegreen\">.: ScreenShot :.</span></b><br />  <br />  <br />  <img class=\"lazyjs bbcodeImage\" src=\"http://i.imgur.com/iTjeI3P.gif\" data-original=\"http://i.imgur.com/iTjeI3P.gif\" alt=\"image\" /> <img class=\"lazyjs bbcodeImage\" src=\"http://i.imgur.com/yCeh7UK.gif\" data-original=\"http://i.imgur.com/yCeh7UK.gif\" alt=\"image\" /><br />  <br />  <img class=\"lazyjs bbcodeImage\" src=\"http://i.imgur.com/gndl9oK.gif\" data-original=\"http://i.imgur.com/gndl9oK.gif\" alt=\"image\" /> <img class=\"lazyjs bbcodeImage\" src=\"http://i.imgur.com/UpsZA4F.gif\" data-original=\"http://i.imgur.com/UpsZA4F.gif\" alt=\"image\" /><br />  <br />  <img class=\"lazyjs bbcodeImage\" src=\"http://i.imgur.com/yuvRbhd.gif\" data-original=\"http://i.imgur.com/yuvRbhd.gif\" alt=\"image\" /> <img class=\"lazyjs bbcodeImage\" src=\"http://i.imgur.com/HL4yhNi.gif\" data-original=\"http://i.imgur.com/HL4yhNi.gif\" alt=\"image\" /><br />  <br />  <img class=\"lazyjs bbcodeImage\" src=\"http://i.imgur.com/TOPOK2F.gif\" data-original=\"http://i.imgur