INSERT INTO `description` VALUES ('317', '<div class=\"textcontent\" id=\"desc\"> 							Thumbs<br />  <a rel=\"nofollow\" href=\"http://gallerynova.se/site/v/256121\" class=\"ajaxLink\" target=\"_blank\">http://gallerynova.se/site/v/256121</a><br />  <br />  <br />  Tireur d\'élite des Navy SEAL, Chris Kyle est envoyé en Irak dans un seul but : protéger ses camarades. Sa précision chirurgicale sauve d\'innombrables vies humaines sur le champ de bataille et, tandis que les récits de ses exploits se multiplient, il décroche le surnom de \"La Légende\". Cependant, sa réputation se propage au-delà des lignes ennemies, si bien que sa tête est mise à prix et qu\'il devient une cible privilégiée des insurgés. Malgré le danger, et l\'angoisse dans laquelle vit sa famille, Chris participe à quatre batailles décisives parmi les plus terribles de la guerre en Irak, s\'imposant ainsi comme l\'incarnation vivante de la devise des SEAL : \"Pas de quartier !\" Mais en rentrant au pays, Chris prend conscience qu\'il ne parvient pas à retrouver une vie normale. 						</div>');
