INSERT INTO `description` VALUES ('394', '<div class=\"textcontent\" id=\"desc\"> 							<div class=\"center\"><img class=\"lazyjs bbcodeImage\" src=\"http://i.imgur.com/uuLaoAv.png\" data-original=\"http://i.imgur.com/uuLaoAv.png\" alt=\"image\" /><br />  <br />  <b><span style=\"color:red\">PRESENTA:<br />  <br />  The Originals S02e05 DLMux XviD ITA/ENG</span></b><br />  <br />  <img class=\"lazyjs bbcodeImage\" src=\"http://i.imgur.com/NtRb9Vi.png\" data-original=\"http://i.imgur.com/NtRb9Vi.png\" alt=\"image\" /><br />  <br />  <img class=\"lazyjs bbcodeImage\" src=\"http://i.imgur.com/Yd42Z28.png\" data-original=\"http://i.imgur.com/Yd42Z28.png\" alt=\"image\" /><br />  <br />  <b>Nome: The Originals<br />  Anno: 2013 - In Corso <br />  Genere: Horror, Thiller, Fantasy<br />  Produzione: Warners Bros<br />  <br />  Cast:<br />  Joseph Morgan: Klaus Mikaelson<br />  Daniel Gillies: Elijah Mikaelson<br />  Claire Holt: Rebekah Mikaelson (st. 1[1])<br />  Phoebe Tonkin: Hayley Marshall Charles<br />  Michael Davis: Marcel Gerard<br />  Daniella Pineda: Sophie Deveraux (st. 1[2])<br />  Leah Pipes: Camille O\'Connell<br />  Danielle Campbell: Davina<br />  Claire Yusuf Gatewood: Vincent Griffith (st. 2+[3])<br />   <br />  <br />  <br />  Stagione 2<br />  Episodi: 22<br />  Durata episodio: 50 minuti</b><br />  <br />  <img class=\"lazyjs bbcodeImage\" src=\"http://i.imgur.com/gRRZiPZ.png\" data-original=\"http://i.imgur.com/gRRZiPZ.png\" alt=\"image\" /><br />  <br />  Niklaus Mikaelson è l\'ibrido appartenente alla famiglia dei Vampiri Originali che si trasferisce dalla cittadina di Mystic Falls (Virginia) a New Orleans, città che lui e i suoi fratelli contribuirono a costruire ma che poi abbandonarono per fuggire da loro padre, che gli dava la caccia. Con il suo ritorno, Klaus scopre che Marcel, vampiro che lui stesso trasformò secoli prima, detiene il controllo del quartiere francese della città e di tutte le creature sovrannaturali che lo abitano, comprese le streghe che non possono praticare la magia senza il suo permesso. Quest\'ultime, guidate dalla giovane strega Sophie Deveraux, vogliono stipulare un patto con Klaus: se lui le aiuterà ad eliminare Marcel loro proteggeranno Hayley, la giovane licantropa che aspetta una figlia da lui. Klaus, spinto dalla responsabilità di padre e dalla voglia di rubare il controllo della città a Marcel e convinto dal fratello maggiore Elijah, accetta il patto e decide di rimanere a New Orleans. Mesi dopo, anche Rebekah, la sorella di Klaus ed Elijah, giunge in città e si ricongiunge con i suoi fratelli.<br />  <br />  <img class=\"lazyjs bbcodeImage\" src=\"http://i.imgur.com/RAw4wKP.png\" data-original=\"http://i.imgur.com/RAw4wKP.png\" alt=\"image\" /><br />  <br />  <div class=\"spoiler_container\">&nbsp;<a class=\"spoiler_show siteButton smallButton\" target=\"_blank\"><span>show spoiler</span></a><div class=\"spoiler_js\"><br />  About file<br />  <br />  Name The.Originals.S02e02.Vivi.E.Vegeti.ITA.ENG.XviD.Subs.DLMux-BlackBIT.<br />   avi<br />  Date Mon, 02 Mar 2015 17:57:49 +0100<br />  Size 593,170,432 bytes (565.691406 MiB)<br />  <br />  Magic<br />  <br />  File type RIFF (little-endian) data, AVI, 720 x 404, 23.98 fps, video: XviD,<br />   audio: Dolby AC3 (stereo, 48000 Hz)<br />  <br />  Generic infos<br />  <br />  Duration 00:42:35 (2555.096763 s)<br />  Container AVI OpenDML<br />  AVI has index Yes<br />  Total tracks 3<br />  Track nr. 0 video<br />  Track nr. 1 audio<br />  Track nr. 2 audio<br />  ISFT VirtualDubMod 1.5.10.2 (build 2540/release)<br />  Junk VirtualDubMod build 2540/release<br />  <br />  Relevant data<br />  <br />  Resolution 720 x 404<br />  Width multiple of 16<br />  Height multiple of 4<br />  Average DRF 2<br />  Standard deviation 0<br />  Std. dev. weighted mean 0<br />  <br />  Video track<br />  <br />  FourCC XVID/XVID<br />  Resolution 720 x 404<br />  Frame aspect ratio 180:101 = 1.782178 (~16:9)<br />  Pixel aspect ratio 1:1 = 1<b