INSERT INTO `description` VALUES ('399', '<div class=\"textcontent\" id=\"desc\"> 							<br />  <img class=\"lazyjs bbcodeImage\" src=\"http://i.share.pho.to/d5a7d5ad_o.jpeg\" data-original=\"http://i.share.pho.to/d5a7d5ad_o.jpeg\" alt=\"image\" /><br />  <br />  Collection includes:<br />  -Old PDF-scan uploads now in clean epub/mobi format<br />  -New epub/mobi books shorter than 100-130 pages<br />  <br />  Titles:<br />  1 in 23,000,000<br />  A Survey of the Authorized Version<br />  About the New King James Version<br />  About the New Scofield Reference Bible<br />  Alexandrian Cult Series<br />  Art And Artists<br />  Bible Numerics<br />  Biblical Scholarship<br />  Body, Soul, And Spirit<br />  Custer’s Last Stand<br />  Differences in the King James Version Editions<br />  E=MC2<br />  Eternal Security<br />  Fact, Faith, And Feeling<br />  Five Heresies Examined<br />  Four Judgments<br />  God Is Love<br />  Happy Anniversary, KJV!<br />  Heaven and Hell<br />  How to Teach Dispensational Truth<br />  How to Teach The Bible<br />  How To Teach The \'\'Original\'\' Greek<br />  Hyper Dispensationalism<br />  Hyper-Calvinism<br />  King James Onlyism versus Scholarship Onlyism<br />  King James Onlyism vs Scholarship Onlyism<br />  Marriage, Divorce And Remarriage<br />  Music and Musicians<br />  ROME: The Great Private Interpreter<br />  Roots and Methodology<br />  Ruckman\'s Battlefield Notes<br />  Satan’s Masterpiece: The New ASV<br />  Seven Baptisms<br />  Seven Mysteries<br />  Seven Resurrections<br />  The Anti-Intellectual Manifesto<br />  The Bible: A Deadly Book<br />  The Christian’s Handbook of Science and Philosophy<br />  The Corrupt Catholic Cult<br />  The Damnation of a Nation<br />  The Death of Biblical Doctrine<br />  The God-Called Preacher<br />  The Holy Scriptures vs. The Holy Koran<br />  The Judgment Seat of Christ<br />  The Local Church<br />  The Mass<br />  The Mythological Septuagint<br />  The NIV: An \'\'In-Depth\'\' Documentation Of Apostasy<br />  The Path of the Second Advent<br />  The Power of Negative Thinking<br />  The Professional Liars In Action<br />  The Restoration of Israel<br />  The Scholarship Only Controvers<br />  The Simplicity of Salvation<br />  The Source of International Terrorism<br />  The Tabernacle<br />  The Two Raptures<br />  The Unknown Bible<br />  The White Throne Judgment<br />  Things I Have Not Learned<br />  Tongues, Signs, And Healing<br />  What Saith the Scriptures<br />  Where Do the Dead Go?<br />  Why I Am Not A Calvinist<br />  Why I Am Not A Campbellite<br />  Why I Am Not A Catholic<br />  Why I Am Not A Charismatic<br />  Why I Am Not A Moslem<br />  Why I Am Not A \'\'New Age\'\' Global Citizen<br />  Why I Am Not A Seventh-Day Adventist<br />  Why I Believe the King James Bible is the Word of God<br />  Will The Real \'\'ALLAH\'\' Please Stand Up?<br />  <br />  <br />  About the author:<br />  Dr. Peter S. Ruckman received his Bachelor of Arts degree from the University of Alabama and finished his formal education with six years of training at Bob Jones University (four full years and two accelerated summer sessions), completing requirements for the Master of Arts and Doctor of Philosophy degree.<br />  Reading at a rate of seven hundred words per minute, Dr. Ruckman had managed to read about 6,500 books before receiving his doctorate, and he still reads an average of a book each day.<br />  Dr. Ruckman stands for the absolute authority of the Authorized Version and offers no apology to any recognized scholar anywhere for his stand. In addition to preaching the gospel and teaching the Bible, Dr. Ruckman has produced a comprehensive collection of apologetic and polemic literature and resources supporting the authority of the Authorized Version of the Holy Scriptures.<br />  <br />  <br />  Buy the Complete 7-Foot Shelf Collection: ALL of Dr. Ruckman\'s writings:<br />  <a rel=\"nofollow\" href=\"http://store.kjv1611.org/ruckmans-seven-foot-shelf-collection/\" class=\"ajaxLink\" target=\"_blank\">http://store.kjv1611.org/ruc...seven-foot-shelf-collection/</a><br />  <br />  <br />  <img class=\"lazyjs bbcodeImage\" src=\"http://imagizer.imageshack.us/a/img63/980/keepseeding.gif\" data-original=\"http://imagizer.imageshack.us/a/img63/980/keepseeding.gif\" alt=\"image\" /> 						</div>');
