INSERT INTO `description` VALUES ('402', '<div class=\"textcontent\" id=\"desc\"> 							<br />  <img class=\"lazyjs bbcodeImage\" src=\"http://i.share.pho.to/e2fc3ca7_o.jpeg\" data-original=\"http://i.share.pho.to/e2fc3ca7_o.jpeg\" alt=\"image\" /><br />  <br />  <br />  <span style=\"text-decoration: underline;\">About the author:</span><br />  Dr. Peter S. Ruckman received his Bachelor of Arts degree from the University of Alabama and finished his formal education with six years of training at Bob Jones University (four full years and two accelerated summer sessions), completing requirements for the Master of Arts and Doctor of Philosophy degree.<br />  Reading at a rate of seven hundred words per minute, Dr. Ruckman had managed to read about 6,500 books before receiving his doctorate, and he still reads an average of a book each day.<br />  Dr. Ruckman stands for the absolute authority of the Authorized Version and offers no apology to any recognized scholar anywhere for his stand. In addition to preaching the gospel and teaching the Bible, Dr. Ruckman has produced a comprehensive collection of apologetic and polemic literature and resources supporting the authority of the Authorized Version of the Holy Scriptures.<br />  <br />  <br />  Buy:<br />  <a rel=\"nofollow\" href=\"http://store.kjv1611.org/entire-collection-of-dr-peter-s-ruckmans-commentaries/\" class=\"ajaxLink\" target=\"_blank\">http://store.kjv1611.org/ent...ter-s-ruckmans-commentaries/</a><br />  <br />  <br />  <img class=\"lazyjs bbcodeImage\" src=\"http://imagizer.imageshack.us/a/img63/980/keepseeding.gif\" data-original=\"http://imagizer.imageshack.us/a/img63/980/keepseeding.gif\" alt=\"image\" /><br />  <br />  <br />  <br />  <span style=\"text-decoration: underline;\">About the books:</span><br />  <b>Acts Commentary:</b><br />  In this commentary, Dr. Ruckman deals with the second great transitional book in the New Testament, and examines the doctrinal transition from the nation of Israel to the Church, the Body of Christ. Because of the progressive nature of revelation through the book of Acts, it has become a great source of error for many heresies. The author examines these heresies, and clearly shows how correct dispensational teaching clears up these errors. The lives of the apostles and early Christians are presented in modern terms, making for an interesting read and practical application.<br />  The critical changes to the text made by the modern versions are exposed and discussed with proof for the accuracy and authority of the King James text. <br />  <br />  <b>Corinthians Commentary:</b><br />  This commentary is THE commentary for the local church. It covers such important material as divisions in the local church, the Judgment Seat of Christ, sin in the local church, the restoration of the sinning saint, the temple of the Holy Spirit, the Resurrection, the Rapture, Eternity, and New Testament giving. <br />  <br />  <b>Ecclesiastes Commentary:</b><br />  Unlike the book of Proverbs, Ecclesiastes is not the imparted wisdom of God to Solomon, but true worldly wisdom that Solomon learned by experience \"under the sun.\" It is the diary of a Deist who totally devoted himself to excessive materialism. As such, it is the perfect book for modern America. In his commentary on Ecclesiastes, Dr. Ruckman examines every major philosophy taught in Colleges and Universities which Solomon explored 500 years before the Greek philosophers ever showed up. Objections to the authorship of the book are refuted, and the incompetent bungling of the text by Evangelicals and Fundamentalists is critiqued. Ecclesiastes was written for the thinking and educated man, so this work is perfect for high school and College students.<br />  <br />  <b>Exodus Commentary:</b><br />  Dr. Ruckman\'s commentary on the second book of the Bible covers the doctrinal and practical material involved in the historical transformation of the family of Jacob into the nation of Israel. Colorful interpretations of the people and events of the book are presented in Dr. Ruckman\'s own unique style, while at the same time giving a running critique of the mistakes of the scholars on the text of the Authorized Version. Careful attention is paid to the typology in Exodus, especially in regards to Moses as a type of Christ and the pictures of New Testament salvation in the Tabernacle.<br />  <br />  <b>Ezra, Nehemiah, Esther Commentary:</b><br />  This commentary deals with the three \"post-exilic\" historical books of the Old Testament. Dr. Ruckman gives the prophetic material on the restoration of Israel and the premillennial layout of the books, showing that they are not just dead history. In Ezra, reference is made to the prophets Haggai and Zechariah and their influence. Nehemiah contains practical application to the New Testament ministry. A detailed analysis is made of the prophetic typology in Esther in regards to Israel and the Antichrist. <br />  <br />  <b>Galatians, Ephesians, Philippians, Colossians Commentary:</b><br />  This commentary on the heart of the Pauline Epistles covers the doctrinal and practical teachings of the Apostle of the Gentiles to the New Testament believer. The heresies of the Hyper-Calvinists and Hyper-dispensationalists are examined, and the attacks of the scholars on the AV text are critiqued. In Colossians, a history of philosophy is given, as well as the prophetic relation of the book to the Laodicean church period. <br />  <br />  <b>General Epistles Commentary, Volume 1-2:</b><br />  In this commentary, Dr. Ruckman gives the proper doctrinal context for the first three books of the Hebrew-Christian epistles, carefully showing which passages are doctrinally for the New Testament Christian in the Church Age and which apply to Jews in the Tribulation. Prevalent heretical teachings on these books are examined and corrected from the Scriptures. Other doctrines of interest covered in this work are: the inspiration and authority of the Scriptures, the ministry of Christ between his death and resurrection, the duties of the pastor, and the Gap of Genesis 1:1-2.<br />  In this work, Dr. Ruckman examines the transitional nature of the Johannine Epistles and Jude in regards to the Church Age and the Tribulation. Particular emphasis is put on the double applications that can be made of certain passages. Current peculiar heresies on certain passages are also exposed and dealt with. The textual evidence for the so-called \"Johannine Coma\" is laid out showing the accuracy and authority of the AV text. <br />  <br />  <b>Genesis Commentary:</b><br />  This is a verse-by-verse commentary on the first book of the Bible. In this volume, Dr. Ruckman covers all the problems raised by the higher critics of the text of the Old Testament, as well as show how all major philosophies are refuted right in the first verse. The fallacies of evolution are examined and proofs provided for the existence of God, the special creation of the universe and man, and the universal Flood of Noah. Other doctrines discussed are the Gap of Genesis 1:1-2, the structure of the universe, the identity of the forbidden fruit, and the sons of God in Genesis 6. The lives of Biblical people are dramatized in modern fashion, and close attention is given to the prophecies and typology in the book, especially in regards to Joseph as the greatest type of Jesus Christ found in the Old Testament.<br />  <br />  <b>Hebrews Commentary:</b><br />  The book of Hebrews is one of the most misinterpreted books of the Bible. This commentary will be welcomed by anyone interested in doctrine. The question of authorship is covered, along with textual difficulties and misapplications of Tribulation passages to the Body of Christ.<br />  <br />  <b>Job Commentary:</b><br />  The book of Job was the first book of the Bible ever written, and it is THE book for a literary man. It deals with the basic human question of \"why do the righteous suffer?\" In this volume, Dr. Ruckman deals with the critical questions of authorship and text. Job is examined as a type of Christ, the Antichrist, the Tribulation Jew, a sinner in Hell, and a Christian. Doctrines discussed are the person of Satan, the structure of the universe, the Judgment Seat of Christ, the identity of the sons of God, Mystery Babylon, and the Battle of Armageddon. The practical aspects of the book are illustrated with testimonies of the author\'s own personal experiences in the ministry. <br />  <br />  <b>John Commentary:</b><br />  The Gospel of John is the fourth biography of the earthly life of Jesus Christ by a Christian biographer who was an eyewitness to His ministry from John the Baptist up until His return to Glory.<br />  This commentary covers the doctrinal, practical, and critical view of the \"odd Gospel\" of the four, and clearly shows the distinctions between those passages applicable to the Jews of Christ\'s time and those to Christians in the New Testament Church. Dr. Ruckman also examines the doctrines of Christ\'s Diety, the New Birth, the Mass, the Antichrist, and the Holy Spirit, while examining how Christ dealt with sinners one on one. <br />  <br />  <b>Joshua Commentary:</b><br />  A commentary based on Dr. Ruckman\'s Sunday school classes on the first of the historical books of the Old Testament. It deals with the historical accuracy of the conquest of Canaan under Israel\'s greatest General and the miracles associated with it. Special attention is given to the prophetic application of the book to the Second Advent and to the practical applications that can be made to the Christian\'s spiritual warfare against the world, the flesh, and the Devil. The geography of the book is tied in to associated events in the rest of the Old Testament, with a map at the the to help the reader locate the major cities in Joshua, as well as the division of the tribes in the land. <br />  <br />  <b>Luke Commentary:</b><br />  This study on the third Gospel emphasizes the historical accuracy of the eyewitness accounts Luke used in compiling his work. The doctrinal and textual differences between the “synoptic” Gospels are examined and explained. The material unique to the Gospel, especially the parables, is exegeted not only from the standpoint of sound doctrine, but with evangelistic application in mind as well.<br />  <br />  <b>Matthew Commentary:</b><br />  Matthew is the first of three transitional books in the New Testament (the other two being Acts and Hebrews). In this commentary, Dr. Ruckman examines the move from the Old Testament to the New Testament in the book of Matthew, with special emphasis laid on the Jewish nature and application of the book. Common false teachings are refuted; and critical problems such as the genealogies, the Sermon on the Mount, and the Resurrection accounts are thoroughly discussed. The dispensational and prophetic aspects of the book are also given careful consideration. The work is presented in Dr. Ruckman\'s straightforward and plain style, making it an easy read that is readily understandable to both beginning and more advanced students of the Scriptures.<br />  <br />  <b>Minor Prophets Commentary, Volume 1-2:</b><br />  The Minor Prophets (Hosea - Malachi) are some of the most neglected books in the Bible, yet they are part of \"all scripture\" and are as \"profitable\" as any other part of the Bible (2 Tim. 3:16). In this first volume, Dr. Ruckman covers the books of Hosea, Joel, Amos, Obadiah, Jonah, Micah, and Nahum. Emphasis is placed on the main theme of the Prophets: the Second Advent of Jesus Christ. The critical attacks on and changes to the text by the expositors and modern translations are also examined and refuted. The dispensational and prophetic material on the nation of Israel in the Church Age, the Tribulation, and the Millennium is presented as well.<br />  This is the long awaited conclusion to Dr. Ruckman’s commentary on the most neglected books of the Bible. This volume covers the books of Habakkuk, Zephaniah, Haggai, Zechariah, and Malachi. All these books deal with the main theme of the bible: The Second Coming of the Lord Jesus Christ. Also included are the doctrines of the Restoration of Israel, Tithing, Divorce and Remarriage, the double application of certain prophecies to both Advents, the Deity of Christ, and the Path of the Second Advent.<br />  <br />  <b>Pastorial Epistles Commentary:</b><br />  This commentary covers Paul\'s epistles to Timothy and Titus. This work is especially practical and useful to anyone who is studying for or already in the Christian ministry, with sermon outlines included in every chapter. In particular, the attacks of the Bible critics and correctors on \"Terrible Timothy\" are examined. Twenty-six appendices are included at the back of the book on the subject of the King James Version. In this volume, Dr. Ruckman gives the believing student of the Scriptures a commentary on the books of 1 &amp; 2 Timothy and Titus which will preserve his faith in the text of the AV 1611 Holy Bible and enable him to teach and preach those books without making any of the several thousand corrections recommended by the scholars. <br />  <br />  <b>Proverbs Commentary:</b><br />  In this volume, Dr. Ruckman examines the divine wisdom revealed to Solomon in 1000 B.C. He gives spiritual insight not only on the devotional material in the book, but also the doctrinal, prophetic, and textual content ignored by most other commentators. The Masoretic text of the Hebrew Bible and English text of the Authorized Version are compared with the textual deviations of the Greek Septuagint and the ASV of 1901. In this work, over a hundred sermon illustrations are presented with vast amounts of material on government, art, music, sports, agriculture, history, domestics, war, and modern living. The book of Proverbs, as no other book in the Bible, delivers to its readers the true \"wisdom of the ancients.\"<br />  <br />  <b>Psalms Commentary, Volume 1-2:</b><br />  This is the first volume of Dr. Ruckman\'s commentary on the nineteenth book of the Bible. The book of Psalms is divided into five sections matching the five books of the Pentateuch. Volume I covers the first two sections: chapters 1-41 and chapters 42-72. For the saints, Psalms is THE devotional book of all time. It is the repository, the castle, the bomb shelter, the supply center, and the hospital to which they repair when wounded and bleeding, crushed by the world, the flesh, and the Devil. But the Psalms also have plenty of doctrinal meat in them as well. There is more material on the Second Coming of Christ in the Psalms that there is in all four Gospels combined. Dr. Ruckman covers both the doctrinal and devotional aspects of the book. Of special interest in this first volume are the doctrine of Zionism in Psalm 2, the prophecies on the Crucifixion of Christ in Psalm 22, and the Marriage of the Lamb in Psalm 45. <br />  This second volume on the Psalms covers the third, fourth, and fifth sections of the book: chapters 73-89, chapters 90-106, and chapters 107-150. In this volume, Dr. Ruckman covers the \"parable\" of Exodus-Joshua (Psa. 73), the psalms of Moses (Psa. 90-91), the longest chapter in the Bible which is about the Bible itself (Psa. 119), the structure of the universe (Psa. 148), and, of course, the material on the Jews in the Tribulation and Millennium found throughout the book. <br />  <br />  <b>Revelation Commentary:</b><br />  This commentary on the last book of the Bible is done in a simple, easy-to-understand, freehand style. In this work, Dr. Ruckman presents the dispensational, premillennial teaching found in the book of Revelation, bringing to light a vast amount of prophetic material not covered in works by other orthodox expositors. Because of its simplicity and content, this commentary has for years been one of his most popular books.<br />  As in all of his works, Dr. Ruckman approaches the book of Revelation with absolute, implicit trust in the Authorized Version of 1611, and with nothing but indifference or contempt for those who think they are smart enough to tamper with it.<br />  <br />  <b>Romans Commentary:</b><br />  The Book of Romans is one of the main books in the New Testament, and one of the greatest books in the entire Bible. It is also the doctrinal book on salvation in the New Testament. Throughout this commentary, you will get a thorough discourse on the doctrines of salvation that are found in this epistle. Plus, it covers the differences of salvation in each age and the doctrines associated with the victorious Christian life. <br />  <br />  <b>Song Of Solomon Commentary:</b><br />  This is Dr. Ruckman\'s final commentary in the Wisdom Book series. In this work, the typology of the Song of Solomon is examined, showing the special relationship between Christ and His Church. Special emphasis is given to the doctrinal and prophetic aspects of this most enigmatic book in the Scriptures. Topics covered are the structure of the universe (chart included), the time of the Rapture, and the path of the Second Advent. Also included are many devotional and practical illustrations and observations on love and marriage, and one\'s personal relationship with Jesus Christ.<br />  <br />  <b>Thessalonians, Philemon Commentary:</b><br />  This is a commentary on the two most important Pauline Epistles for the new c 						</div>');
