INSERT INTO `description` VALUES ('467', '<div class=\"textcontent\" id=\"desc\"> 							TamoSoft CommView for WiFi 7.1.795 (x86/x64) Multilingual<br />  <img class=\"lazyjs bbcodeImage\" src=\"http://i.imgur.com/lgtvGp7.png\" data-original=\"http://i.imgur.com/lgtvGp7.png\" alt=\"image\" /><br />  TamoSoft CommView for WiFi 7.1.795 (x86/x64) Multilingual <br />  <br />  CommView for WiFi is a powerful wireless network monitor and analyzer for 802.11 a/b/g/n networks. Loaded with many user-friendly features, CommView for WiFi combines performance and flexibility with an ease of use unmatched in the industry.<br />  <br />  CommView for WiFi captures every packet on the air to display important information such as the list of access points and stations, per-node and per-channel statistics, signal strength, a list of packets and network connections, protocol distribution charts, etc. By providing this information, CommView for WiFi can help you view and examine packets, pinpoint network problems, and troubleshoot software and hardware.<br />  <br />  CommView for WiFi includes a VoIP module for in-depth analysis, recording, and playback of SIP and H.323 voice communications.<br />  <br />  Packets can be decrypted utilizing user-defined WEP or WPA-PSK keys and are decoded down to the lowest layer. With over 70 supported protocols, this network analyzer allows you to see every detail of a captured packet using a convenient tree-like structure to display protocol layers and packet headers. Additionally, the product provides an open interface for plugging in custom decoding modules. WEP and WPA key retrieval add-ons are available subject to terms and conditions.<br />  <br />  A number of case studies describe real-world applications of CommView for WiFi in business, government, and education sectors.<br />  <br />  CommView for WiFi is a comprehensive and affordable tool for wireless LAN administrators, security professionals, network programmers, or anyone who wants to have a full picture of the WLAN traffic.<br />  <br />  OS : Windows XP, Vista, 7, 8, Server 2003, 2008, 2012 Both 32- and 64-bit Editions<br />  Language : Multilingual<br />  <br />  New in version 7.1 Build 795<br />  March 3rd, 2015<br />  <br />  Quick filters for the Nodes and Channels tabs: filter packets by node, channel, packet type, or data rate with a single click.<br />  Support for Windows 10.<br />  Updated IP allocation map and MAC-to-vendor database.<br />  <br />  INSTALLATION<br />  DOWNLOAD THE TORRENT<br />  THEN INSTALL THE SETUP FILE<br />  <br />  <br />  This is a portable version no need to activate 						</div>');
