INSERT INTO `description` VALUES ('472', '<div class=\"textcontent\" id=\"desc\"> 							Serif DrawPlus X6 13.0.3.26 (x64) Portable<br />  <img class=\"lazyjs bbcodeImage\" src=\"http://i.imgur.com/Q6DGOeS.jpg\" data-original=\"http://i.imgur.com/Q6DGOeS.jpg\" alt=\"image\" /><br />  Serif DrawPlus X6 13.0.3.26 (x64) Portable <br />  Use intuitive vector drawing tools, flexible shapes and natural media brushes to create bespoke designs, logos, technical drawings, animations and so much more. DrawPlus X6 is the perfect platform to express your creativity. DrawPlus X6 offers the complete drawing and editing experience. Simple vector drawing tools help you create custom lines, shapes and curves, with advanced tools for targeted drawing, merging and blending. And because the final image is a vector drawing, you can easily rescale artwork without losing quality.<br />  <br />  DrawPlus X6 brings your design visions to life with intricate shapes, colours and effects. There are new tools for drawing arcs and triangles plus a new Stencils Tab offering a wide selection of ready-made templates that are perfect for adding impact across all your designs.<br />  <br />  Bring your designs to life<br />  Putting together great looking drawings and artwork is only half the fun; DrawPlus X6 also offers a variety of creative ways to bring your ideas to life. It’s so easy to see your drawings in stunning 3D with the Instant 3D tool, apply lighting and surface effects and create eye-catching documents and logos with artistic text and frames. For more technical drawings, connector tools and perspective planes give you the freedom to create flowcharts, scaled floor layouts and isometric drawings.<br />  <br />  Want your text to stand out? No problem. Experiment with classic filter effects like outline or drop shadow and, for the first time, set text to flow around objects.<br />  <br />  Achieve professional looking results<br />  Easy-to-use features help you achieve precise results. Whether you’re drawing, painting, tracing or editing, accurate colour management options, that support CMYK and RGB documents, ensure you’ll achieve colour consistency across all the media you design for.<br />  <br />  Build up designs with layers that you can edit individually, apply non-destructible Graphic Styles, that won’t permanently change your original work, and use the special multi-level Solo Mode to isolate and work on specific elements of the same image.<br />  <br />  Plus there are creative options like Blend Modes; which allow you to control how objects interact and the new Palette Creator, which automatically generates a palette of colours from an image.<br />  <br />  Develop your photo editing skills<br />  As a complete design package, DrawPlus X6 makes it easy to include images in your drawings or plans and improve them with professional-quality effects. The comprehensive PhotoLab, Cutout and AutoTrace studios allow you to enhance images, perform accurate photo cut-outs and instantly turn photos into vector artwork.<br />  <br />  Apply non-destructive adjustments to sharpen up your images plus remove red eye and blemishes – there’s no need to switch to a separate photo editor! DrawPlus supports multiple files types such as JPEG, PNG and GIF as well as Adobe® Photoshop® files.<br />  <br />  Authentic painting techniques<br />  DrawPlus X6 includes a wide selection of watercolour, pastel, charcoal and other realistic-looking brushes. Photo-quality spray brushes allow you to add paint splats, glitter, flowers and many more decorative effects.<br />  <br />  Plus with support for graphics tablets and a built-in Pressure Studio for controlling the sensitivity of brush strokes, your digital art skills will feel more realistic.<br />  <br />  Striking web graphics and animations<br />  Give your websites that professional touch with striking web graphics and animations – easy to create in DrawPlus X6. Create pixel-perfect web buttons with rollover graphics that are HTML embedded as well as Flash banners that will instantly grab the attention of your visitors.<br />  <br />  Want to create high quality animations or even movies? Use keyframe or stop frame methods to capture movement frame-by-frame. When you’re happy with your animation, DrawPlus X6 makes it easy to export it as a SWF, MOV, AVI or WMV video file.<br />  <br />  Share your designs and artwork<br />  DrawPlus X6 has a built-in export optimiser and supports over 18 export file formats meaning you achieve the highest-quality output however you choose to showcase your designs.<br />  <br />  Want to get your artwork professionally printed? PDF import, editing and export means you can prepare your artwork and have it ready-to-go in minutes!<br />  <br />  DrawPlus X6 supports PDF/X1, 1a and, for the first time, PDF/X-3: a file type required by some professional printers.<br />  <br />  Drawing software that’s so easy-to-use<br />  - Quick starter: Get started with a wide range of templates for posters and greeting cards.<br />  - Ignite your creativity: Over 4000 ready-made pieces of vector art and sample designs to get you started.<br />  - So easy-to-use: Enjoy a quick and simple interface and customisable tabs to suit the way you work.<br />  - Faster than ever: Native support for 32 and 64-bit computers gives you the fastest design experience yet.<br />  - Edit existing documents: Open and edit existing PDFs, EPS, SVG and AutoCad files.<br />  <br />  Updates: official site does not provide any info about changes in this version<br />  <br />  INSTALLATION<br />  DOWNLOAD THE TORRENT<br />  THEN INSTALL THE SETUP FILE<br />  <br />  <br />  This is a portable version no need to activate 						</div>');
