INSERT INTO `description` VALUES ('693', '<div class=\"textcontent\" id=\"desc\"> 							\"When Isabeau hears Mr. Drake\'s side of the story, she has two choices: to take him at his word, or walk out of his life. She chooses to trust him and accompanies him to a dinner party at his mother\'s house, only to have more secrets about Drake\'s mysterious past whispered in her ear by his handsome business partner, Alexander Smith. Can she give herself fully to a man she\'s not sure can trust with her heart? Or should she believe him when he says she\'s different from all the rest? \"<br />  <br />  This is an erotic ebook. There is no ISBN. I got this off another site and thought people would like here. I am not the original uploader of this. The authors name is Delilah Fawkes.<br />  <br />  If you like this torrent please leave feedback and rate.  						</div>');
