INSERT INTO `description` VALUES ('697', '<div class=\"textcontent\" id=\"desc\"> 							<img class=\"lazyjs bbcodeImage\" src=\"https://d.gr-assets.com/books/1394579450l/21424554.jpg\" data-original=\"https://d.gr-assets.com/books/1394579450l/21424554.jpg\" alt=\"image\" /><br />  <br />  <br /> <br /> <b>Summary</b><br />  <br />  <br /> <br />  AMAZON BEST SELLING AUTHOR! AMAZON BEST SELLING SERIES!! LEGAL HEIRS: In this highly anticipated new saga of the Surrendering Charlotte Chronicles, a fresh generation is born, but old habits die hard. The tortured triangle between Charlotte, Bly and Finn is put to the test. Can Maddie stand the heat of being a billionaire’s wife? The love affairs and loyalties of JP and Amanda, West and Evangeline, and even Jude, are in jeopardy. What would the Legal series be without a few jaw-dropping surprises? Who are these new additions, and are they all welcome bundles of joy? Everything happens as it’s meant to, as Charlotte and company play out their dramas and set the stage for their legal heirs! LEGAL HEIRS 2: Who committed the original sin, Charlotte, Finn, or Bly? Does it really matter if a new act of betrayal has the power to ruin them all? Desire and deceit go hand in hand and come in unexpected forms, the two together will unleash a chain of events that will alter lives forever. Charlotte will feel the sting of deception that sends her careening down a forbidden path. In the end one little boy’s future hangs in the balance. The heirs have grown up in the prequel to Legal Heirs 3, Hearts of Fire, and their lives will be wilder and more fascinating than anything that has come before! LEGAL HEIRS 3: HERE WE GO! Another wild ride with Charlotte, Bly, Finn, and the gang from LEGAL ACTION!!! Answers from the past and action for the present!!! Did Finn forgive Charlotte? Who ended up with her love? Also, a few surprising new developments are always part of the story! By the way, is Atticus a Bly or a Hale? What happened in the 13 years when the heirs were growing up, AND, what are they up to now that they’re free to run the world?!!! The past, the present, and all the thrilling details that keep the LEGAL SERIES going strong, while keeping readers on the edge of their seats and wanting more!!! LEGAL HEIRS 4: The Ghost has Charlotte, Angus has Skyler… so many lives hang in the balance! Bly and Finn will have to strike a serious bargain and come to terms over Charlotte’s love… more than once. Holden and Hadley find their bliss, but Hadley’s career is about to sky-rocket, and… there’s a new bad-boy in town. Atticus has some serious soul searching to do, is he truly “a child of luck and fortune”? Big changes are in store in this final book of the Legal Heirs series, paving the way for the final four books to come in Legal Legacy!!! GET ALL 4 BOOKS NOW, THIS SPECIAL PRICE WON\"T LAST!! SPECIAL INTRODUCTORY PRICE OF ONLY 7.95 FOR ALL 4 NOVELLAS! (Regular price 11.96 when buying all 4 novellas separately) If you haven\'t already, read BOOK ONE of this series entitled, LEGAL ACTION, it\'s FREE on Amazon!! <br />  <br />  <br /> <br />  <br />  <br /> <br /> <i><small><br />  <br />  <br /> <br /> Title: Legal Heirs - Box Set Edition; Books 5-8 (Surrendering Charlotte Chronicles #5-8)<br />  <br />  <br /> <br /> Author(s): Kimball Lee<br />  <br />  <br /> <br /> Published March 2nd 2014 by Green Pastures Ink<br />  <br />  <br /> <br /> Language: English<br />  <br />  <br /> <br /> Length: Kindle Edition, 310 pages<br />  <br />  <br /> <br /> Series: Surrendering Charlotte Chronicles #5-8 <br />  <br />  <br /> <br />  <br />  <br />  <br />  <br />  <br /> </small></i><br />  <br />  <small><br />  Uploaded using:<br />  <a rel=\"nofollow\" href=\"/community/show/plex-s-upload-tool/\" target=\"_blank\">PleX\'s Upload Tool</a> v5.8-RC-03<br />  </small> 						</div>');
INSERT INTO `description` VALUES ('699', '<div class=\"textcontent\" id=\"desc\"> 							<b><span style=\"color:blue\">THE WALKING DEAD<br />  STAGIONE 5<br />  DLMUX 720p </span><br />  <br />  Dual Language ITA - ENG<br />  Sub ITA - ENG<br />  For more information<br />  www.tntvillage.scambioetico.org<br />  www.imdb.com/title/tt1520211/<br />  </b><br />  <br />  <img class=\"lazyjs bbcodeImage\" src=\"http://i.imgur.com/Zrwp64F.jpg\" data-original=\"http://i.imgur.com/Zrwp64F.jpg\" alt=\"image\" /><br />  <br />  <span style=\"color:blue\"><b>Dati Serie </b></span><br />  <br />  <br />  <b>Nazione</b>: USA<br />  <b>Anno</b>: 2010 - in produzione<br />  <b>Genere</b>: azione, drammatico, horror<br />  <b>Stagioni</b> 5<br />  <b>Episodi</b>: 67<br />  <b>Durata</b>: 45 min circa<br />  <b>Lingua</b>: ITA - ENG<br />  <b>Ideatore</b>: Frank Darabont, Robert Kirkman<br />  <b>Cast</b>: <br />      <b>Interpreti e personaggi</b><br />  <b>Andrew Lincoln:</b> Rick Grimes<br />  <b>Jon Bernthal:</b> Shane Walsh<br />  <b>Sarah Wayne Callies:</b> Lori Grimes<br />  <b>Laurie Holden:</b> Andrea<br />  <b>Jeffrey DeMunn:</b> Dale Horvath<br />  <b>Steven Yeun:</b> Glenn<br />  <b>Norman Reedus:</b> Daryl Dixon<br />  <b>Chandler Riggs:</b> Carl Grimes<br />  <b>Melissa McBride:</b> Carol Peletier<br />  <br />  <br />  <img class=\"lazyjs bbcodeImage\" src=\"http://i.imgur.com/KZMz2L5.jpg\" data-original=\"http://i.imgur.com/KZMz2L5.jpg\" alt=\"image\" /><br />  <br />  <br />  <span style=\"color:blue\"><b>Trama  </b></span><br />  <br />  Rick Grimes is a former Sheriff\'s deputy who has been in a coma for several months after being shot while on duty. When he wakes, he discovers that the world has been taken over by zombies, and that he seems to be the only person still alive. After returning home to discover his wife and son missing, he heads for Atlanta to search for his family. Narrowly escaping death at the hands of the zombies on arrival in Atlanta, he is aided by another survivor Glenn who takes Rick to a camp outside the town. There Rick finds his wife Lori and son Carl, along with his partner/best friend Shane and a small group of survivors who struggle to fend off the zombie hordes; as well as competing with other survivor groups who are prepared to do whatever it takes to survive. Written by Contributors<br />  <br />  The Walking Dead è la serie tv prodotta dal prestigioso network televisivo AMC e distribuita a livello internazionale da FOX International Channels, basata sul fumetto bestseller di Robert Kirkman, pubblicato da Image Comics in USA e da Saldapress in Italia.<br />  The Walking Dead è un drama ricco di azione e suspense che racconta la storia di un gruppo di americani sopravvissuti a un’invasione di zombie. Guidati dal poliziotto Rick Grimes (interpretato dall’attore inglese Andrew Lincoln, già visto in AfterLife), i superstiti vagano alla ricerca di un posto sicuro dove potersi rifugiare, e lungo il cammino affrontano numerosi pericoli e conflitti, anche di natura personale. Perchè non esiste più un posto dove sentirsi al sicuro, e non è più tempo per sperare. Bisogna solo sopravvivere, ad ogni costo!<br />  <br />  <br />  <span style=\"color:blue\"><b>Screenshot </b></span><br />  <br />  <a rel=\"nofollow\" href=\"http://www.imagebam.com/image/24f515357592078\" class=\"ajaxLink\" target=\"_blank\"><img class=\"lazyjs bbcodeImage\" src=\"http://thumbnails111.imagebam.com/35760/24f515357592078.jpg\" data-original=\"http://thumbnails111.imagebam.com/35760/24f515357592078.jpg\" alt=\"image\" /></a> <a rel=\"nofollow\" href=\"http://www.imagebam.com/image/219eb7357592141\" class=\"ajaxLink\" target=\"_blank\"><img class=\"lazyjs bbcodeImage\" src=\"http://thumbnails109.imagebam.com/35760/219eb7357592141.jpg\" data-original=\"http://thumbnails109.imagebam.com/35760/219eb7357592141.jpg\" alt=\"image\" /></a> <br />  <br />  <a rel=\"nofollow\" href=\"http://www.imagebam.com/image/13b1e4357592199\" class=