INSERT INTO `description` VALUES ('712', '<div class=\"textcontent\" id=\"desc\"> 							<div class=\"center\"><span style=\"font-size:150%\"><span style=\"color:blue\"><b>Igrzyska śmierci: Kosogłos. Część 1 - The Hunger Games: Mockingjay Part 1 (2014)</b></span></span><br />  <br />  <span style=\"color:red\"><b>Storyline:</b></span><br />  <br />  With the Games destroyed, Katniss Everdeen, along with Gale, Finnick and Beetee, end up in the so thought \"destroyed\" District 13. Under the leadership of President Coin and the advice of her friends, Katniss becomes the \"Mockingjay\", the symbol of rebellion for the districts of Panem.<br />  <br />  Trzecia część \"Igrzysk śmierci\", jednego z największych kinowych hitów ostatnich lat i nowej, wielkiej popkulturowej sagi. W imponującej obsadzie znaleźli się nagrodzeni Oscarami Jennifer Lawrence i Phillip Seymour, a także Donald Sutherland. Po raz pierwszy w „Igrzyskach śmierci”, w jednej z kluczowych ról, zobaczymy Julianne Moore. <br />  <br />  Katniss wraz z matką i siostrą mieszka w legendarnym, podziemnym dystrykcie trzynastym, który, wbrew kłamliwej propagandzie, przetrwał zemstę Kapitolu. Z nowymi przywódcami na czele, rebelianci je bać tnt przygotowują się do rozprawy z dyktatorską władzą. Katniss, mimo początkowych wahań, zgadza się wziąć udział w walce. Staje się symbolem oporu przeciw tyranii prezydenta Snowa.<br />  <br />  <span style=\"color:red\"><b>Screenshot:</b></span><br />  <br />  <a rel=\"nofollow\" href=\"http://imgur.com/ihQCsxO\" target=\"_blank\"><img class=\"lazyjs bbcodeImage\" src=\"http://i.imgur.com/ihQCsxO.jpg\" data-original=\"http://i.imgur.com/ihQCsxO.jpg\" alt=\"image\" /></a><br />  <a rel=\"nofollow\" href=\"http://imgur.com/pHaH1z5\" target=\"_blank\"><img class=\"lazyjs bbcodeImage\" src=\"http://i.imgur.com/pHaH1z5.jpg\" data-original=\"http://i.imgur.com/pHaH1z5.jpg\" alt=\"image\" /></a><br />  <a rel=\"nofollow\" href=\"http://imgur.com/GRajB3T\" target=\"_blank\"><img cla