INSERT INTO `description` VALUES ('777', '<div class=\"textcontent\" id=\"desc\"> 							<br />  <br />  Fans can look forward to a classic Star Wars nostalgia. The long-awaited release of the original theatrical incarnations of the classic Star Wars trilogy.<br />  In response to overwhelming demand, Lucasfilm Ltd. and Twentieth Century Fox Home Entertainment has released an attractively, individual release of Star Wars, The Empire Strikes Back and Return Of The Jedi. That means you\'ll be able to enjoy Star Wars as it first appeared in 1977, Empire in 1980, and Jedi in 1983. <br />  <br />  <br />  See the title crawl to Star Wars before it was known as Episode IV; see the pioneering, if dated, motion control model work on the attack on the Death Star; groove to Lapti Nek or the Ewok Celebration song like you did when you were a kid; and yes, see Han Solo shoot first. <br />  <br />  <br />  \"Over the years, a truly countless number of fans have told us that they would love to see and own the original version that they remember experiencing in theaters,\" said Jim Ward, President of LucasArts and Senior Vice President of Lucasfilm Ltd. \"We returned to the Lucasfilm Archives to search exhaustively for source material that could be presented on DVD. This is something that we\'re very excited to be able to give to fans in response to their continuing enthusiasm for Star Wars. Topping it off with a new interactive adventure makes September 12 (2006) a red-letter day for Star Wars fans.\"<br />  <br />  <br />  <br />  Additional Details<br />  ===========<br />  <br />  Directed By: George Lucas, Irvin Kershner, Richard Marquand.<br />  <br />  Runtime: Star Wars - 2 Hours, 1 Minute, 7 Seconds.<br />  <br />  Runtime: The Empire Strikes Back - 2 Hours, 4 Minutes, 53 Seconds<br />  <br />  Runtime: Return Of The Jedi - 2 Hours, 11 Minutes, 42 Seconds.<br />  <br />  Genre: Action / Adventure / Fantasy / Science Fiction<br />  <br />  Country: USA<br />  <br />  Langu