INSERT INTO `description` VALUES ('819', '<div class=\"textcontent\" id=\"desc\"> 							<b>2015 | ISBN: 1617291951 | English | 344 pages | PDF | 5 MB</b><br />  <img class=\"lazyjs bbcodeImage\" src=\"http://pixhst.com/avaxhome/53/e1/0033e153.jpeg\" data-original=\"http://pixhst.com/avaxhome/53/e1/0033e153.jpeg\" alt=\"image\" /><br />  <span style=\"font-size:200%\"><b>Torrent Release From TorrentHub</b></span><br />  <br />  <span style=\"font-size:120%\">Summary<br />  <br />  JavaScript Application Design: A Build First Approach introduces JavaScript developers to techniques that will improve the quality of their software as well as their web development workflow. You\'ll begin by learning how to establish build processes that are appropriate for JavaScript-driven development. Then, you\'ll walk through best practices for productive day-to-day development, like running tasks when your code changes, deploying applications with a single command, and monitoring the state of your application once it\'s in production.<br />  <br />  Purchase of the print book includes a free eBook in PDF, Kindle, and ePub formats from Manning Publications.<br />  <br />  About the Book<br />  <br />  The fate of most applications is often sealed before a single line of code has been written. How is that possible? Simply, bad design assures bad results. Good design and effective processes are the foundation on which maintainable applications are built, scaled, and improved. For JavaScript developers, this means discovering the tooling, modern libraries, and architectural patterns that enable those improvements.<br />  <br />  JavaScript Application Design: A Build First Approach introduces techniques to improve software quality and development workflow. You\'ll begin by learning how to establish processes designed to optimize the quality of your work. You\'ll execute tasks whenever your code changes, run tests on every commit, and deploy in an automated fashion. Then you\'ll focus on designing modular components and composing them together to build robust applications.<br />  <br />  This book assumes readers understand the basics of JavaScript.<br />  <br />  What\'s Inside<br />  <br />  Automated development, testing, and deployment processes<br />  JavaScript fundamentals and modularity best practices<br />  Modular, maintainable, and well-tested applications<br />  Master asynchronous flows, embrace MVC, and design a REST API<br />  About the Author<br />  <br />  Nicolas Bevacqua is a freelance developer with a focus on modular JavaScript, build processes, and sharp design. He maintains a blog at ponyfoo.com.<br />  <br />  Table of Contents<br />  <br />  PART 1 BUILD PROCESSES<br />  <br />  Introduction to Build First<br />  Composing build tasks and flows<br />  Mastering environments and the development workflow<br />  Release, deployment, and monitoring<br />  PART 2 MANAGING COMPLEXITY<br />  <br />  Embracing modularity and dependency management<br />  Understanding asynchronous flow control methods in JavaScript<br />  Leveraging the Model-View-Controller<br />  Testing JavaScript components<br />  REST API design and layered service architectures</span> 						</div>');
