INSERT INTO `description` VALUES ('827', '<div class=\"textcontent\" id=\"desc\"> 							<a href=\"//yuq.me/users/47/082/zX57JlbLI8.jpg\" rel=\"gallery_94980\" class=\"ajaxLink\" target=\"_blank\"><img class=\"bbcodeImage\" src=\"//yuq.me/users/47/082/zX57JlbLI8t.jpg\" alt=\"image\" /></a><br />  PDF. Text replaced, re-formatted to single column for easier screen reading, text and pictures moved together, bookmarks, fully searchable.<br />  “Just as the medical profession has its particular fields of endeavor, the gunsmithing trade is the same. A truly custom pistolsmith is a specialist in his own right. To be a good pistolsmith requires certain traits: Almost without exception, he must be a shooter; he must have a thorough knowledge of ballistics; he must be mechanically inclined and be as stubborn as a Missouri mule. A great part of knowing when a pistol is right is by the feel. If the pistolsmith can‘t shoot a tight group with the fruits o f his labors, the probability is that his customer won‘t either. Pistols have a lot of parts confined within a small frame; each can be the cause of problems. Being a good pistolsmith requir es the tenacity to solve each problem, returning to the customer a firearm that is as durable as the mechanical design will permit, as reliable as though a life might depend upon it and as accurate as the particular model is able to perform.” 						</div>');
