INSERT INTO `description` VALUES ('836', '<div class=\"textcontent\" id=\"desc\"> 							<div class=\"center\"><img class=\"lazyjs bbcodeImage\" src=\"http://www.imagebox.ws/images/2014/10/x4j1fhal6f3du74rly2r.jpg\" data-original=\"http://www.imagebox.ws/images/2014/10/x4j1fhal6f3du74rly2r.jpg\" alt=\"image\" /><br />  <br />  <br />  The most realistic and detailed virtual oud instrument ever released! Plectra Series 4 includes a custom-made, masterwork Turkish Oud performed by Stelios Varveris and produced by Dimitris Plagiannis. It features all crucial articulations, a gorgeous &amp; inspiring UI, and a full microtuning engine for authentic playing.<br />  <br />  Continuing our tradition of beautifully-sampled, stringed Plectra Series instruments comes the Turkish Oud. This Kontakt library, produced by Dimitris Plagiannis, sets a new standard for depth, playability, and realism in non-Western sampled instruments. We are delighted to present plectra Series 4 - the most realistic and playable virtual oud ever released.<br />  <br />  The history of the oud extends back to antiquity, having been referenced in writings over 1,000 years old. It is a fretless, stringed instrument that has been used in both Middle Eastern and European music for many centuries, and is now played all over the world. The instrument we sampled is a custom-made, double soundboard Turkish oud by Faruk Trnz. The instrument was performed by Stelios Varveris and recorded with pristine Neumann &amp; AKG mics through an SSL console in a treated studio room.<br />  <br />  Our goal in creating this library was to produce an incredibly intuitive instrument that simply sounds great out of the box. The powerful script engine seamlessly voices notes and chords - no complex keyswitches required. Advanced users can delve into the gorgeous, inspiring user interface for custom mix controls like microphone blend, EQ, compression, and reverb, and microtuning presets can be used to achieve incredibly authentic performances.<br />  <br />  We are thrilled to make this instrument available to you, and hope that you will use it in many compositions from film/TV/game scores to authentic mockups, or even rock &amp; pop tracks. Enjoy!<br />  <br />  <br />  <br />  home page:<br />  <a rel=\"nofollow\" href=\"http://impactsoundworks.com/products/world/plectra-series-4-turkish-oud/\" class=\"ajaxLink\" target=\"_blank\">http://impactsoundworks.com/...ries-4-turkish-oud/</a></div> 						</div>');
