INSERT INTO `description` VALUES ('1015', '<div class=\"textcontent\" id=\"desc\"> 							<div class=\"center\"><br />  <img class=\"lazyjs bbcodeImage\" src=\"http://i.imgur.com/hq1WKDk.png\" data-original=\"http://i.imgur.com/hq1WKDk.png\" alt=\"image\" /><br />  <br />  <br />  <br />  <img class=\"lazyjs bbcodeImage\" src=\"http://i.imgur.com/MA9Zpjv.png\" data-original=\"http://i.imgur.com/MA9Zpjv.png\" alt=\"image\" /><br />  <br />  <b><br />  Titolo originale: 	Dagon<br />  Nazione: 	Spagna<br />  Anno: 	2001<br />  Genere: 	Horror<br />  Durata: 	95\'<br />  Regia: 	Stuart Gordon<br />  Sito ufficiale: 	movies.fantasticfactory.com/dagon<br />  <br />  Cast: 	Ezra Godden, Raquel Merono, Francisco Rabal.<br />  Produzione: 	Fantastic Factory<br />  Distribuzione: 	Eagle Pictures<br />  </b><br />  <br />  <img class=\"lazyjs bbcodeImage\" src=\"http://i.imgur.com/MPAi65q.png\" data-original=\"http://i.imgur.com/MPAi65q.png\" alt=\"image\" /><br />  <br />  <b>Incappato in un violento fortunale che danneggia gravemente il suo yacht, Paul, giovane imprenditore rampante in gita con la fidanzata Barbara ed una coppia di amici, sbarca in cerca di aiuto sulla costa spagnola, nei pressi di Imboca, un piccolo villaggio di pescatori. Ma invece della salvezza, si trova al centro di un incubo. L\'aspetto malsano e abulico dei pochi abitanti, e le misere case fatiscenti in cui vivono sono la conseguenza del patto blasfemo che hanno stretto con Dagon, una ancestrale entità degli abissi marini, che ha garantito la pescosità delle acque in cambio della loro adorazione. Uno dopo l\'altro i compagni di Paul finiscono sacrificati negli spaventosi riti officiati per quella sanguinaria divinità, mentre per lui c\'è in serbo la più sconvolgente delle rivelazioni.....<br />  <br />  Rimarchevole trasposizione dei racconti \"Dagon\" e \"The Shadow Over Innsmouth\" (più noto in Italia con il titolo \"La maschera di Innsmouth\")di H. P. Lovecraft, questo film è stato prodotto da Brian Yuzna e diretto da Stuart Gordon, collaudata coppia che dello stesso autore aveva già portato sullo schermo Re-Animator e From Beyond. <br />  Costruito con tale fedeltà e rispetto per i testi originari da farsi perdonare qualche passaggio a vuoto ed alcune inevitabili licenze, riesce come forse nessun altro a ricreare le atmosfere orrorifiche, e quel senso di corruzione e dissoluzione che permea e identifica le opere di Lovecraft. Ottima la fotografia, più che adeguata la colonna sonora e notevoli gli effetti speciali, che anche quano virano nello splatter mantengono decisamente un buon livello.<br />  </b><br />  <br />  <br />  <img class=\"lazyjs bbcodeImage\" src=\"http://i.imgur.com/0bqHhx9.png\" data-original=\"http://i.imgur.com/0bqHhx9.png\" alt=\"image\" /><br />  <br />  <a rel=\"nofollow\" href=\"http://www.imagebam.com/image/a3eafe399807858\" class=\"ajaxLink\" target=\"_blank\"><img class=\"lazyjs bbcodeImage\" src=\"http://thumbnails110.imagebam.com/39981/a3eafe399807858.jpg\" data-original=\"http://thumbnails110.imagebam.com/39981/a3eafe399807858.jpg\" alt=\"image\" /></a> <a rel=\"nofollow\" href=\"http://www.imagebam.com/image/ba6f51399807896\" class=\"ajaxLink\" target=\"_blank\"><img class=\"lazyjs bbcodeImage\" src=\"http://thumbnails110.imagebam.com/39981/ba6f51399807896.jpg\" data-original=\"http://thumbnails110.imagebam.com/39981/ba6f51399807896.jpg\" alt=\"image\" /></a> <a rel=\"nofollow\" href=\"http://www.imagebam.com/image/95273a399807965\" class=\"ajaxLink\" target=\"_blank\"><img class=\"lazyjs bbcodeImage\" src=\"http://thumbnails112.imagebam.com/39981/95273a399807965.jpg\" data-original=\"http://thumbnails112.imagebam.com/39981/95273a399807965.jpg\" alt=\"image\" /></a> <a rel=\"nofollow\" href=\"http://www.imagebam.com/image/c2f3da399807980\" class=\"ajaxLink\" target=\"_blank\"><img class=\"lazyjs bbcodeImage\" src=\"http://thumbnails110.imagebam.com/39981/c2f3da399807980.jpg\" data-original=\"http://thumbnails110.imagebam.com/39