INSERT INTO `description` VALUES ('1207', '<div class=\"textcontent\" id=\"desc\"> 							<div class=\"center\"><img class=\"lazyjs bbcodeImage\" src=\"https://yuq.me/users/42/322/iOU86v2W4X.jpg\" data-original=\"https://yuq.me/users/42/322/iOU86v2W4X.jpg\" alt=\"image\" /><br />  <br />  WhatsApp Messenger is a smartphone messenger available for Android and other smartphones. WhatsApp uses your 3G or WiFi (when available) to message with friends and family.<br />  <br />  <b><br />  <span style=\"text-decoration: underline;\">Features</span> :</b><br />  <br />  Switch from SMS to WhatsApp to send and receive messages, pictures, audio notes, and video messages. First year FREE! ($0.99 USD/year after)<br />  WHY USE WHATSAPP:<br />  ★ NO HIDDEN COST: Once you and your friends download the application, you can use it to chat as much as you want. Send a million messages a day to your friends for free! WhatsApp uses your Internet connection: 3G/EDGE or Wi-Fi when available.<br />  ★ MULTIMEDIA: Send Video, Images, and Voice notes to your friends and contacts.<br />  ★ GROUP CHAT: Enjoy group conversations with your contacts.<br />  ★ NO INTERNATIONAL CHARGES: Just like there is no added cost to send an international email, there is no cost to send WhatsApp messages internationally. Chat with your friends all over the world as long as they have WhatsApp Messenger installed and avoid those pesky international SMS costs.<br />  ★ SAY NO TO PINS AND USERNAMES: Why even bother having to remember yet another PIN or username? WhatsApp works with your phone number, just like SMS would, and integrates flawlessly with your existing phone address book.<br />  ★ NO NEED TO LOG IN/OUT: No more confusion about getting logged off from another computer or device. With push notifications WhatsApp is ALWAYS ON and ALWAYS CONNECTED.<br />  ★ NO NEED TO ADD BUDDIES: Your Address Book is used to automatically connect you with your contacts. Your contacts who already have WhatsApp Messenger will be automatically displayed.<br />  ★ OFFLINE MESSAGES: Even if you miss your push notifications or turn off your phone, WhatsApp will save your messages offline until you retrieve them during the next application use.<br />  ★ AND MUCH MORE: Share location, Exchange contacts, Custom wallpaper, Custom notification sounds, Landscape mode, Precise message time stamps, Email chat history, Broadcast messages and MMS to many contacts at once and much much more!<br />  <br />  <b><span style=\"text-decoration: underline;\">System Requirements</span> :</b><br />  <br />  Requires Android: 2.1 +<br />  <br />  <b><span style=\"text-decoration: underline;\">What\'s New</span> :</b><br />  <br />  • Introducing WhatsApp Web: You can now send and receive WhatsApp messages right from your computer’s browser. To get started, visit web.whatsapp.com on your computer.<br />  • Bug fixes and other improvements<br />  <br />  <b><span style=\"text-decoration: underline;\">Support and Follow us</span> :</b><br />  <br />  <a rel=\"nofollow\" href=\"http://appzdam.blogspot.com/\" class=\"ajaxLink\" target=\"_blank\"><img class=\"lazyjs bbcodeImage\" src=\"https://yuq.me/users/42/322/kZpRn0QgmL.jpg\" data-original=\"https://yuq.me/users/42/322/kZpRn0QgmL.jpg\" alt=\"image\" /></a><br />  <br />  <a rel=\"nofollow\" href=\"https://www.facebook.com/AppzDam\" target=\"_blank\"><img class=\"lazyjs bbcodeImage\" src=\"https://yuq.me/users/42/322/idnIjUMwPm.jpg\" data-original=\"https://yuq.me/users/42/322/idnIjUMwPm.jpg\" alt=\"image\" /></a><br />  <br />  <a rel=\"nofollow\" href=\"https://twitter.com/AppzDam\" target=\"_blank\"><img class=\"lazyjs bbcodeImage\" src=\"https://yuq.me/users/42/322/UVHxGEjtLl.jpg\" data-original=\"https://yuq.me/users/42/322/UVHxGEjtLl.jpg\" alt=\"image\" /></a><br />  <br />  <a rel=\"nofollow\" href=\"https://plus.google.com/u/0/me?tab=XX\" class=\"ajaxLink\" target=\"_blank\"><img class=\"lazyjs bbcodeImage\" src=\"https://yuq.me/users/42/322/Kq1oCHcv