INSERT INTO `description` VALUES ('1225', '<div class=\"textcontent\" id=\"desc\"> 							ISBN: 978-3-527-31824-7<br />  <br />  <img class=\"lazyjs bbcodeImage\" src=\"http://ecx.images-amazon.com/images/I/91dwGRoADAL.jpg\" data-original=\"http://ecx.images-amazon.com/images/I/91dwGRoADAL.jpg\" alt=\"image\" /><br />  <br />  <div class=\"justify\">This introductory textbook covers all aspects of catalysis. It also bridges computational methods, industrial applications and green chemistry, with over 700 references. The author, a renowned researcher in catalysis, teaches scientific writing as well as chemistry. This makes him the ideal person to write such a textbook. The effectiveness of his practical approach has been well proven in courses for undergraduates and graduates (in 2007 he was voted \"lecturer of the year\" by the chemistry students). Following an introduction to green chemistry and the basics of catalysis, the book covers biocatalysis, homogeneous catalysis and heterogeneous catalysis, as well as computer applications in catalysis research. Each chapter also features integrated exercises that help students prepare for their exams.</div> 						</div>');
